(1, 0, '<p>2+2 = ?</p>', '<p>1</p>', '<p>2</p>', '<p>3</p>', '<p>4</p>', 'ans4', 1, 1, 0, '', '', '', '', '', '', 5, '', '', 'N'),
(2, 0, '<p><span style="color: #555555; font-family: ''Open Sans'', Helvetica, Arial, sans-serif; font-size: 13px; line-height: 13px;">Recently, the union government has given in-principle approval for the creation of two new tiger reserves at ____?&nbsp;</span></p>', '<p><span style="color: #555555; font-family: ''Open Sans'', Helvetica, Arial, sans-serif; font-size: 13px; line-height: 13px;">Ratapani and Sunabeda</span></p>', '<p><span style="color: #555555; font-family: ''Open Sans'', Helvetica, Arial, sans-serif; font-size: 13px; line-height: 13px;">Rajaji and Bor</span></p>', '<p><span style="color: #555555; font-family: ''Open Sans'', Helvetica, Arial, sans-serif; font-size: 13px; line-height: 13px;">Kudremukh and Bor</span></p>', '<p><span style="color: #555555; font-family: ''Open Sans'', Helvetica, Arial, sans-serif; font-size: 13px; line-height: 13px;">Ratapani and Rajaji</span></p>', 'ans1', 5, 5, 0, '', '', '', '', '', '', 1, '', '<p><span style="color: #555555; font-family: ''Open Sans'', Helvetica, Arial, sans-serif; font-size: 13px; line-height: 13px;"><strong>Ratapani and Sunabeda</strong> In-principle approval has been accorded by the National Tiger Conservation Authority (NTCA) for the creation of two new tiger reserves at Ratapani (Madhya Pradesh) and Sunabeda in Odisha.</span></p>', 'N'),
(3, 0, '<p>who is current pm of india?</p>', '<p>MANMOHAN SINGH</p>', '<p>Indira Gandhi</p>', '<p>Narendra Modi</p>', '<p>Pranav Mukherjee</p>', 'ans3', 5, 5, 0, '', '', '', '', '', '', 10, '', '<p>Narendra Modi</p>', 'N'),
(4, 0, '<p>a;lskd;askdfdsffas</p>', '<p>asdfasdf</p>', '<p>asdfas</p>', '', '<p>asdf</p>', 'ans3', 5, 5, 0, '', '', '', '', '', '', 12, '', '<p>adfadf</p>', 'N'),
(11, 3, '<p><strong style="color: #222222; font-family: Arial, Helvetica, sans-serif; font-size: 13px; line-height: 20.42300033569336px; text-align: justify;">Which of the following country is India&rsquo;s top trading partner?</strong></p>', '<p><span style="color: #222222; font-family: Arial, Helvetica, sans-serif; font-size: 13px; line-height: 20.42300033569336px; text-align: justify;">China</span></p>', '<p><span style="color: #222222; font-family: Arial, Helvetica, sans-serif; font-size: 13px; line-height: 20.42300033569336px; text-align: justify;">UAE</span></p>', '<p><span style="color: #222222; font-family: Arial, Helvetica, sans-serif; font-size: 13px; line-height: 20.42300033569336px; text-align: justify;">Saudi Arabia</span></p>', '<p><span style="color: #222222; font-family: Arial, Helvetica, sans-serif; font-size: 13px; line-height: 20.42300033569336px; text-align: justify;">United States</span></p>', 'ans2', 5, 5, 0, '', '', '', '', '', '', 1, '', '', 'N'),
(12, 3, '<p><strong style="color: #222222; font-family: Arial, Helvetica, sans-serif; font-size: 13px; line-height: 20.42300033569336px; text-align: justify;">Who among the following is the head of National Skill Development Coordination Board?</strong></p>', '<p><span style="color: #222222; font-family: Arial, Helvetica, sans-serif; font-size: 13px; line-height: 20.42300033569336px; text-align: justify;">Manmohan Singh</span></p>', '<p><span style="color: #222222; font-family: Arial, Helvetica, sans-serif; font-size: 13px; line-height: 20.42300033569336px; text-align: justify;">Sonia Gandhi</span></p>', '<p><span style="color: #222222; font-family: Arial, Helvetica, sans-serif; font-size: 13px; line-height: 20.42300033569336px; text-align: justify;">Pranab Mukherjee</span></p>', '<p><span style="color: #222222; font-family: Arial, Helvetica, sans-serif; font-size: 13px; line-height: 20.42300033569336px; text-align: justify;">Montek Singh Ahluvalia</span></p>', 'ans4', 5, 5, 0, '', '', '', '', '', '', 1, '', '', 'N'),
(13, 3, '<p><strong style="color: #222222; font-family: Arial, Helvetica, sans-serif; font-size: 13px; line-height: 20.42300033569336px; text-align: justify;">Which of the following two states in India together account for about half of the total mango production in India?</strong></p>', '<p><span style="color: #222222; font-family: Arial, Helvetica, sans-serif; font-size: 13px; line-height: 20.42300033569336px; text-align: justify;">Andhra Pradesh and Uttar Pradesh</span></p>', '<p><span style="color: #222222; font-family: Arial, Helvetica, sans-serif; font-size: 13px; line-height: 20.42300033569336px; text-align: justify;">Andhra Pradesh and Karnataka</span></p>', '<p><span style="color: #222222; font-family: Arial, Helvetica, sans-serif; font-size: 13px; line-height: 20.42300033569336px; text-align: justify;">Kerala and Uttar Pradesh</span></p>', '<p><span style="color: #222222; font-family: Arial, Helvetica, sans-serif; font-size: 13px; line-height: 20.42300033569336px; text-align: justify;">&nbsp;Andhra Pradesh and Bihar</span></p>', 'ans1', 5, 5, 0, '', '', '', '', '', '', 1, '', '', 'N'),
