(36, 4, '<p><span style="font-size: small;">The value of [(256)<sup>0.19</sup> &times; (256)<sup>0.06</sup>]/[(7)<sup>0.25</sup> &times; (49)<sup>0.075</sup> &times; (343)<sup>0.2</sup>] is equal to ?</span></p>', '<p><span style="font-size: small;">1</span></p>', '<p><span style="font-size: small;">(4/7)</span></p>', '<p><span style="font-size: small;">(7/4)<sup>-2</sup></span></p>', '<p><span style="font-size: small;">(4/7)<sup>3</sup></span></p>', 'ans2', 1, 1, 0, '', '', '', '', '', '', 1, '', '<p><span style="font-size: small;">[(256)<sup>0.19</sup> &times; (256)<sup>0.06</sup>]/[(7)<sup>0.25</sup> &times; (49)<sup>0.075</sup> &times; (343)<sup>0.2</sup>]</span></p><br />\r\n<p><span style="font-size: small;">= [(256)<sup>0.19 + 0.06</sup>]/[7<sup>0.25</sup> &times; (7)<sup>2 &times; 0.075</sup> &times; (7)<sup>3 &times; 0.2</sup>]</span></p><br />\r\n<p><span style="font-size: small;">= (4<sup>4</sup>)<sup>0.25</sup>/[7<sup>0.25</sup> &times; 7<sup>0.15</sup> &times; 7<sup>0.6</sup>] = 4/7</span></p><br />\r\n<p><span style="font-size: small;">The correct answer is B.</span></p>', 'N'),
