(40, 4, '<p><span style="font-size: small;">What is the factorized form of the polynomial 125<em>x</em><sup>3</sup> &minus; 64<em>y</em><sup>3</sup> &minus; 300<em>x</em><sup>2</sup><em>y</em> + 240<em>xy</em><sup>2</sup>?</span></p>', '<p><span style="font-size: small;">(2<em>x</em> &minus; <em>y</em>) (5<em>x</em> + <em>y</em>) (5<em>x</em> &minus; <em>y</em>)</span></p>', '<p><span style="font-size: small;">(2<em>x</em> + <em>y</em>) (5<em>x</em> &minus; <em>y</em>) (5<em>x</em> &minus; <em>y</em>)</span></p>', '<p><span style="font-size: small;">(5<em>x</em> &minus; 4<em>y</em>) (5<em>x</em> &minus; 4<em>y</em>) (5<em>x</em> &minus; 4<em>y</em>)</span><sup> </sup></p>', '<p><span style="font-size: small;">(5<em>x</em> + 4<em>y</em>) (5<em>x</em> + 4<em>y</em>) (5<em>x</em> + 4<em>y</em>)</span></p>', 'ans3', 1, 1, 0, '', '', '', '', '', '', 1, '', '<p><span style="font-size: small;">The given polynomial can be factorised as:</span></p><br />\r\n<p><span style="font-size: small;">125<em>x</em><sup>3</sup> &minus; 64<em>y</em><sup>3</sup> &minus; 300<em>x</em><sup>2</sup><em>y</em> + 240<em>xy</em><sup>2</sup></span></p><br />\r\n<p><span style="font-size: small;">= (5<em>x</em>)<sup>3</sup> &minus; (4<em>y</em>)<sup>3</sup> &minus; 3 (5<em>x</em>)<sup>2</sup> (4<em>y</em>) + 3 (5<em>x</em>) (4<em>y</em>)<sup>2</sup></span></p><br />\r\n<p><span style="font-size: small;">= (5<em>x</em>)<sup>3</sup> &minus; (4<em>y</em>)<sup>3</sup> &minus; 3 (5<em>x</em>) (4<em>y</em>) (5<em>x</em> &minus; 4<em>y</em>)</span></p><br />\r\n<p><span style="font-size: small;">= (5<em>x</em> &minus; 4<em>y</em>)<sup>3</sup> [(<em>a</em> &minus; <em>b</em>)<sup>3</sup> = <em>a</em><sup>3</sup> &minus; <em>b</em><sup>3</sup> &minus; 3<em>ab</em> (<em>a</em> &minus; <em>b</em>)]</span></p><br />\r\n<p><span style="font-size: small;">= (5<em>x</em> &minus; 4<em>y</em>) (5<em>x</em> &minus; 4<em>y</em>) (5<em>x</em> &minus; 4<em>y</em>)</span></p><br />\r\n<p><span style="font-size: small;">The correct answer is 3.</span></p>', 'N'),
