(46, 4, '<p><span style="font-size: small;">Rahul&rsquo;s father&rsquo;s weight is 1.7 times the weight of Rahul. If the weight of Rahul&rsquo;s father is 108.8 kg, then what is the combined total weight of Rahul and his father?</span></p>', '<p><span style="font-size: small;">161.3 kg</span></p>', '<p><span style="font-size: small;">172.8 kg</span></p>', '<p><span style="font-size: small;">200.4 kg</span></p>', '<p><span style="font-size: small;">248.9 kg</span></p>', 'ans2', 1, 1, 0, '', '', '', '', '', '', 1, '', '<p><img src="http://s15.postimg.org/yeo4clabf/11s.jpg" alt="" width="505" height="237" /></p>', 'N'),
(47, 4, '<p><span style="font-size: small;">The given figure shows a pattern made with alphabet T using matchsticks of same lengths.&nbsp;</span></p><br />\r\n<p><span style="font-size: small;">How many matchsticks are required to make the 14<sup>th</sup> figure in the given pattern?</span></p>', '<p><span style="font-size: small;">46</span></p>', '<p><span style="font-size: small;">48</span></p>', '<p><span style="font-size: small;">54</span></p>', '<p><span style="font-size: small;">58</span></p>', 'ans3', 1, 1, 0, '', '57210fe3bd4e84e70afb1aff6d5cb7ee.JPG', '', '', '', '', 1, '', '<p><span style="font-size: small;">The given pattern is formed by repeating the alphabet T&nbsp;that is made from 2 matchsticks. The number of matchsticks required to form shapes 1, 2, 3, 4 ... are 2, 6, 10, 14 ... respectively. Here, we can see that for each extra shape, we require 4 more matchsticks.</span></p><br />\r\n<p><span style="font-size: small;">2 = 4 &times; 1 &minus; 2</span></p><br />\r\n<p><span style="font-size: small;">6 = 4 &times; 2 &minus; 2</span></p><br />\r\n<p><span style="font-size: small;">10 = 4 &times; 3 &minus; 2</span></p><br />\r\n<p><span style="font-size: small;">14 = 4 &times; 4 &minus; 2</span></p><br />\r\n<p><span style="font-size: small;">Thus, if the given pattern is followed, then we will require (4<em>n</em> &minus;2) number of matchsticks to make <em>n<sup>th</sup> </em>figure.</span></p><br />\r\n<p><span style="font-size: small;">Therefore, to make 14<sup>th</sup> figure, the number of match sticks required = 4 &times; 14 &minus; 2 = 54</span></p><br />\r\n<p><span style="font-size: small;">The correct answer is 3.</span></p>', 'N'),
(48, 4, '<p><span style="font-size: small;">Mohan was asked to solve the equation 6<em>x </em>+ 3 = 27. He solved the equation in the following manner.</span></p><br />\r\n<p><span style="font-size: small;">6<em>x </em>+ 3 = 27</span></p><br />\r\n<p><span style="font-size: small;">What are the respective values of <strong>A</strong>, <strong>B</strong>, <strong>C</strong>, and <strong>D</strong> in the boxes?</span></p>', '<p><span style="font-size: small;">6, 24, 4, and 1</span></p>', '<p><span style="font-size: small;">27, 3, 6, and 2</span></p>', '<p><span style="font-size: small;">4, 6, 24, and 3</span></p>', '<p><span style="font-size: small;">3, 24, 6, and 4</span>&nbsp;</p>', 'ans4', 1, 1, 0, '', 'a28d832f05977d1a5180153d61926146.JPG', '', '', '', '', 1, '', '<p><img src="http://s8.postimg.org/mo5bjy71h/13s.jpg" alt="" width="530" height="331" /></p>', 'N'),
(49, 4, '<p><span style="font-size: small;">The information in which of the following alternatives is <strong>incorrectly</strong> matched?</span></p>', '<table border="1" cellspacing="0" cellpadding="0"><br />\r\n<tbody><br />\r\n<tr><br />\r\n<td><br />\r\n<p><strong><span style="font-size: small;">Number</span></strong></p><br />\r\n</td><br />\r\n<td><br />\r\n<p><strong><span style="font-size: small;">Standard   form</span></strong></p><br />\r\n</td><br />\r\n</tr><br />\r\n<tr><br />\r\n<td><br />\r\n<p><span style="font-size: small;">11278.5</span></p><br />\r\n</td><br />\r\n<td><br />\r\n<p><span style="font-size: small;">1.12785   &times; 10<sup>4</sup></span></p><br />\r\n</td><br />\r\n</tr><br />\r\n</tbody><br />\r\n</table>', '<table border="1" cellspacing="0" cellpadding="0"><br />\r\n<tbody><br />\r\n<tr><br />\r\n<td><br />\r\n<p><strong><span style="font-size: small;">Number</span></strong></p><br />\r\n</td><br />\r\n<td><br />\r\n<p><strong><span style="font-size: small;">Standard   form</span></strong></p><br />\r\n</td><br />\r\n</tr><br />\r\n<tr><br />\r\n<td><br />\r\n<p><span style="font-size: small;">600055</span></p><br />\r\n</td><br />\r\n<td><br />\r\n<p><span style="font-size: small;">6.00055   &times; 10<sup>5</sup></span></p><br />\r\n</td><br />\r\n</tr><br />\r\n</tbody><br />\r\n</table>', '<table border="1" cellspacing="0" cellpadding="0"><br />\r\n<tbody><br />\r\n<tr><br />\r\n<td><br />\r\n<p><strong><span style="font-size: small;">Number</span></strong></p><br />\r\n</td><br />\r\n<td><br />\r\n<p><strong><span style="font-size: small;">Standard   form</span></strong></p><br />\r\n</td><br />\r\n</tr><br />\r\n<tr><br />\r\n<td><br />\r\n<p><span style="font-size: small;">789101112</span></p><br />\r\n</td><br />\r\n<td><br />\r\n<p><span style="font-size: small;">7.89101112   &times; 10<sup>8</sup></span></p><br />\r\n</td><br />\r\n</tr><br />\r\n</tbody><br />\r\n</table>', '<table border="1" cellspacing="0" cellpadding="0"><br />\r\n<tbody><br />\r\n<tr><br />\r\n<td><br />\r\n<p><strong><span style="font-size: small;">Number</span></strong></p><br />\r\n</td><br />\r\n<td><br />\r\n<p><strong><span style="font-size: small;">Standard   form</span></strong></p><br />\r\n</td><br />\r\n</tr><br />\r\n<tr><br />\r\n<td><br />\r\n<p><span style="font-size: small;">656777.8</span></p><br />\r\n</td><br />\r\n<td><br />\r\n<p><span style="font-size: small;">6.567778   &times; 10<sup>6</sup></span></p><br />\r\n</td><br />\r\n</tr><br />\r\n</tbody><br />\r\n</table>', 'ans4', 1, 1, 0, '', '', '', '', '', '', 1, '', '<p><span style="font-size: small;">Any number can be expressed as a decimal number between 1.0 and 10.0, including 1.0 multiplied by a power of 10. The obtained form is called the standard form.</span></p><br />\r\n<p><span style="font-size: small;">The number 656777.8 can be expressed in the standard form as</span></p><br />\r\n<p><span style="font-size: small;">656777.8 = 6.567778 &times; 100000 = 6.567778 &times; 10<sup>5</sup></span></p><br />\r\n<p><span style="font-size: small;">Thus, the information in alternative <strong>4</strong>&nbsp;is incorrectly matched.</span></p><br />\r\n<p><span style="font-size: small;">The correct answer is 4.</span></p>', 'N'),
