(52, 4, '<p><span style="font-size: small;">The weight of 12 iron rods is 63.3 kg. If the weight of each rod is same, then what is the weight of an iron rod?</span></p>', '<p><span style="font-size: small;">5.250 kg</span></p>', '<p><span style="font-size: small;">5.275 kg</span></p>', '<p><span style="font-size: small;">6.35 kg</span></p>', '<p><span style="font-size: small;">6.5 kg</span></p>', 'ans2', 1, 1, 0, '', '', '', '', '', '', 1, '', '<p><span style="font-size: small;">Weight of 12 iron rods = 63.3 kg</span></p><br />\r\n<p><span style="font-size: small;">Weight of 1 iron rod = kg kg = 5.275 kg</span></p><br />\r\n<p><span style="font-size: small;">Thus, the weight of an iron rod is 5.275 kg.</span></p><br />\r\n<p><span style="font-size: small;">The correct answer is 2.</span></p>', 'N'),
