(80, 6, '<p><span style="font-size: small;">The given figure shows a quadrilateral ABCD with its dimensions. It is given that the perimeter of &Delta;ACD is 96 cm, while that of &Delta;ABC is 240 cm.</span></p><br />\r\n<p><span style="font-size: small;">What is the area of quadrilateral ABCD?</span></p>', '<p><span style="font-size: small;">384 cm<sup>2</sup></span></p>', '<p><span style="font-size: small;">1536 cm<sup>2</sup></span></p>', '<p><span style="font-size: small;">1920 cm<sup>2</sup></span></p>', '<p><span style="font-size: small;">2304 cm<sup>2</sup></span></p>', 'ans4', 1, 1, 0, '', '9e61fd258169564826ebc1a823bf54de.JPG', '', '', '', '', 1, '', '', 'N'),
(81, 6, '<p><span style="font-size: small;">If the expression <em>x</em><sup>3</sup> + 3<em>x</em><sup>2</sup> &ndash; 10<em>x</em> &ndash; 24 = (<em>ax</em> + <em>b</em>) (<em>cx</em> + <em>d</em>) (<em>ex</em> + <em>f</em>), where <em>a</em>, <em>b</em>&cedil; and <em>c</em> are non-zero numbers, then which of the following expressions is a factor of the expression (<em>ax</em> + <em>b</em>) + (<em>cx</em> + <em>d</em>) + (<em>ex</em> + <em>f</em>)?</span></p>', '<p><span style="font-size: small;"><em>x</em> + 1</span></p>', '<p><span style="font-size: small;"><em>x</em> &ndash; 1</span></p>', '<p><span style="font-size: small;">x-1/2</span></p>', '<p><span style="font-size: small;">x+1/2</span></p>', 'ans1', 1, 1, 0, '', '', '', '', '', '', 1, '', '', 'N'),
