(84, 6, '<p><span style="font-size: small;">The polynomial 6<em>x</em><sup>3</sup> &ndash; <em>x</em><sup>2</sup> &ndash; 46<em>x</em> &ndash; 15 can be factorized as ?</span></p>', '<p><span style="font-size: small;">(3<em>x</em> &ndash; 5)(2<em>x</em> + 3)(<em>x</em> + 1)</span></p>', '<p><span style="font-size: small;">(3<em>x</em> + 5)(2<em>x</em> &ndash; 3)(<em>x</em> + 1)</span></p>', '<p><span style="font-size: small;">(<em>x</em> &ndash; 3)(2<em>x</em> &ndash; 5)(3<em>x</em> &ndash; 1)</span></p>', '<p><span style="font-size: small;">(<em>x</em> &ndash; 3)(2<em>x</em> + 5)(3<em>x</em> + 1)</span></p>', 'ans4', 1, 1, 0, '', '', '', '', '', '', 1, '', '', 'N'),
(85, 6, '<p><span style="font-size: small;">Which of the following fractions has its decimal equivalent to 242.385718571&hellip;?</span></p>', '<p><span style="font-size: small;">24236148/99990</span></p>', '<p><span style="font-size: small;">23241628/99999</span></p>', '<p><span style="font-size: small;">21232468/99990</span></p>', '<p><span style="font-size: small;">242381648/99999</span></p>', 'ans1', 1, 1, 0, '', '', '', '', '', '', 1, '', '', 'N'),
(86, 6, '<p><span style="font-size: small;">A farmer has a field in the shape of a quadrilateral, as shown in the given figure. He divided the field along the diagonal AC. He sowed cauliflowers in the part labeled &Delta;ADC and turnips in the part labeled &Delta;ABC. He calculated that the profit that he would earn per square meter on the turnips would be ten times that on the cauliflowers. As estimated by the farmer, what would be the ratio of the profits that he would earn on the turnips and the cauliflowers?</span></p>', '<p><span style="font-size: small;">5:1</span></p>', '<p><span style="font-size: small;">10:1</span></p>', '<p><span style="font-size: small;">5&radic;5:1</span></p>', '<p><span style="font-size: small;">10&radic;5:1</span></p>', 'ans4', 1, 1, 0, '', 'd2e56c276816fbf53e74f95c32b459a8.JPG', '', '', '', '', 1, '', '', 'N'),
