(88, 6, '<p><span style="font-size: small;">There is a rhombus shaped field full of green grass to graze. The sides of the field are 34 m each and one of its diagonal is 32 m. There are 30 cows and each cow can graze an area of 2 m<sup>2</sup> in a day. In how many days, the cows can graze the entire field?</span></p>', '<p><span style="font-size: small;">16</span></p>', '<p><span style="font-size: small;">18</span></p>', '<p><span style="font-size: small;">20</span></p>', '<p><span style="font-size: small;">22</span></p>', 'ans1', 1, 1, 0, '', '', '', '', '', '', 1, '', '', 'N'),
