(99, 7, '<p><span style="font-size: small;">Consider the following pair of linear equations in two variables.</span></p>', '<p><span style="font-size: small;">(i) and (ii)</span></p>', '<p><span style="font-size: small;">(iii) and (iv)</span></p>', '<p><span style="font-size: small;">(i) and (iv)</span></p>', '<p><span style="font-size: small;">(ii) and (iii)</span></p>', 'ans4', 1, 1, 0, '', '1d0ad48566046fec3ee9890c9c4d959b.JPG', '', '', '', '', 1, '', '', 'N'),
