(126, 8, '<p><span style="font-size: small;">A graph is plotted between the distances covered by a car in given time intervals, as shown in the given figure.</span></p><br />\r\n<p><span style="font-size: small;">In the region PQ of this graph, the given car</span></p>', '<p><span style="font-size: small;">is at rest at 40 km</span></p>', '<p><span style="font-size: small;">travels a distance of 20 km</span></p>', '<p><span style="font-size: small;">moves with a uniform speed</span></p>', '<p><span style="font-size: small;">moves with a non-uniform speed</span></p>', 'ans1', 2, 6, 0, '', '869031e258e4ca0efb80b31fc87a385f.JPG', '', '', '', '', 1, '', '', 'N'),
(127, 8, '<p><span style="font-size: small;">The formation of a cyclone is depicted in the given figure.</span></p><br />\r\n<p><span style="font-size: small;">In the given figure, region <strong>P</strong> is the</span></p>', '<p><span style="font-size: small;">low-pressure area and region <strong>Q</strong> is the region where wind speed is high</span></p>', '<p><span style="font-size: small;">high-pressure area and region <strong>Q</strong> is the area where wind speed is low</span></p>', '<p><span style="font-size: small;">low-pressure area and region <strong>Q</strong> is the area where wind speed is low</span></p>', '<p><span style="font-size: small;">high-pressure area and region <strong>Q</strong> is the area where wind speed is high</span></p>', 'ans1', 2, 6, 0, '', '12f7493ed5fe949f5154499c0af6ed6e.JPG', '', '', '', '', 1, '', '', 'N'),
(128, 8, '<p><span style="font-size: small;">The fabric and colour of clothes for a particular season should be chosen on the basis of the</span></p>', '<p><span style="font-size: small;">quality and the cost of the fabric</span></p>', '<p><span style="font-size: small;">beauty of the colour and the fabric</span></p>', '<p><span style="font-size: small;">method by which the fabric is obtained</span></p>', '<p><span style="font-size: small;">ability of the fabric and the colour to transfer heat</span></p>', 'ans4', 2, 6, 0, '', '', '', '', '', '', 1, '', '', 'N'),
(129, 8, '<p><span style="font-size: small;">The distances covered by four vehicles namely, car, bus, truck, and van, are plotted in the given distance-time graph.</span></p><br />\r\n<p><span style="font-size: small;">Which vehicle covers the maximum distance in 4 h?</span></p>', '<p><span style="font-size: small;">Car</span></p>', '<p><span style="font-size: small;">Van</span></p>', '<p><span style="font-size: small;">Bus</span></p>', '<p><span style="font-size: small;">Truck</span></p>', 'ans4', 2, 6, 0, '', '204aecc7b63ed928568c54c4f543039f.JPG', '', '', '', '', 1, '', '', 'N'),
(130, 8, '<p><span style="font-size: small;">A low pressure condition is formed during cyclones over a region because of the</span></p>', '<p><span style="font-size: small;">release of heat by air</span></p>', '<p><span style="font-size: small;">release of heat by water vapour</span></p>', '<p><span style="font-size: small;">absorption of heat by land surface</span></p>', '<p><span style="font-size: small;">absorption of heat by water vapour</span></p>', 'ans2', 2, 6, 0, '', '', '', '', '', '', 1, '', '', 'N'),
(131, 8, '<p><span style="font-size: small;">Ramesh fills a black and a white-coloured container with an equal amount of water and leaves them in mid-day sun for about an hour. When he checks the temperature of water in both the containers using a thermometer, he finds that the water in the black-coloured container is hotter.</span></p><br />\r\n<p><span style="font-size: small;">Which of the following statements <strong>cannot</strong> be concluded from the given activity?</span></p>', '<p><span style="font-size: small;">Dark-coloured clothes are preferred during summers.</span></p>', '<p><span style="font-size: small;">Light-coloured clothes should not be worn in winters.</span></p>', '<p><span style="font-size: small;">Dark-coloured clothes are bad reflectors.</span></p>', '<p><span style="font-size: small;">Light-coloured clothes are bad absorbers.</span></p>', 'ans4', 2, 6, 0, '', '', '', '', '', '', 1, '', '', 'N'),
(132, 8, '<p><span style="font-size: small;">A graph is plotted between the distance covered by a car in given time intervals, as shown in the given figure.</span></p><br />\r\n<p><span style="font-size: small;">What is the distance covered by the car in 2 s?</span></p>', '<p><span style="font-size: small;">25 m</span></p>', '<p><span style="font-size: small;">50 m</span></p>', '<p><span style="font-size: small;">75 m</span></p>', '<p><span style="font-size: small;">100 m</span></p>', 'ans2', 2, 6, 0, '', '7e8fc5792358bf71c02710c1529b3d81.JPG', '', '', '', '', 1, '', '', 'N'),
(133, 8, '<p><span style="font-size: small;">Which figure <strong>correctly</strong> depicts the conditions required for the formation of thunderstorms?</span></p>', '<p><img src="http://s21.postimg.org/xsg1ao00n/18a.jpg" alt="" width="238" height="35" /></p>', '<p><img src="http://s30.postimg.org/am64ai8fx/18b.jpg" alt="" width="112" height="62" /></p>', '<p><img src="http://s28.postimg.org/bhoeoq1qx/18c.jpg" alt="" width="100" height="110" /></p>', '<p><img src="http://s28.postimg.org/ffboe4okd/18d.jpg" alt="" width="62" height="221" /></p>', 'ans4', 2, 6, 0, '', '', '', '', '', '', 1, '', '', 'N'),
(134, 8, '<p><span style="font-size: small;">Which colour would you prefer to wear in summers?</span></p>', '<p><span style="font-size: small;">White</span></p>', '<p><span style="font-size: small;">Purple</span></p>', '<p><span style="font-size: small;">Black</span></p>', '<p><span style="font-size: small;">Red</span></p>', 'ans1', 2, 6, 0, '', '', '', '', '', '', 1, '', '', 'N'),
(135, 8, '<p><span style="font-size: small;">The distance&minus;time graph for a vehicle is shown in the given figure.</span></p><br />\r\n<p><span style="font-size: small;">It can be concluded from the distance&minus;time graph that the vehicle</span></p>', '<p><span style="font-size: small;">is not moving</span></p>', '<p><span style="font-size: small;">is moving non-uniformly</span></p>', '<p><span style="font-size: small;">is moving with a speed of 10 m/s</span></p>', '<p><span style="font-size: small;">covers a distance of 20 m in 4 s each</span></p>', 'ans3', 2, 6, 0, '', 'b912fa0bbd07db9d4bdbe7f613d917a4.JPG', '', '', '', '', 1, '', '', 'N'),
(136, 9, '<p><span style="font-size: small;">Atmospheric pressure is defined as the pressure exerted by atmospheric air. To understand the magnitude of this pressure, one can imagine an air column of side 10 cm &times; 10 cm and height equal to the height of the atmosphere, as shown in the given figure. The weight of this column is equal to the atmospheric pressure.</span></p><br />\r\n<p><span style="font-size: small;">The weight of air of the given column is approximately</span></p>', '<p><span style="font-size: small;">10 kg</span></p>', '<p><span style="font-size: small;">100 kg</span></p>', '<p><span style="font-size: small;">1000 kg</span></p>', '<p><span style="font-size: small;">10000 kg</span></p>', 'ans3', 2, 7, 0, '', '618ca6526bc0f7e653b2f1bc102ac52e.jpg', '', '', '', '', 1, '', '', 'N'),
(137, 9, '<p><span style="font-size: small;">The presence of excessive and unwanted noise in the surroundings may cause</span></p>', '<p><span style="font-size: small;">vision defects</span></p>', '<p><span style="font-size: small;">mental problems</span></p>', '<p><span style="font-size: small;">hearing impairment</span></p>', '<p><span style="font-size: small;">breathing difficulty</span></p>', 'ans3', 2, 7, 0, '', '', '', '', '', '', 1, '', '', 'N'),
(138, 9, '<p><span style="font-size: small;">A car designer designed four cars labelled as<strong>&nbsp;I</strong>,<strong>&nbsp;II</strong>,<strong>&nbsp;III</strong>,and&nbsp;<strong>IV</strong>. The shapes of the cars are shown in given figure. On a test drive, these cars are moving with the same speed on a highway. The tank of each car is filled with the same quantity of fuel.</span></p><br />\r\n<p><span style="font-size: small;">In covering equal distances, least fuel is consumed by car</span></p>', '<p><span style="font-size: small;">I</span></p>', '<p><span style="font-size: small;">II</span></p>', '<p><span style="font-size: small;">III</span></p>', '<p><span style="font-size: small;">IV</span></p>', 'ans3', 2, 7, 0, '', '3c452185e76892449a9050a1f5837b94.jpg', '', '', '', '', 1, '', '', 'N'),
(139, 9, '<p><span style="font-size: small;">The pressure exerted by the atmosphere</span></p>', '<p><span style="font-size: small;">increases with the increase in height</span></p>', '<p><span style="font-size: small;">decreases with the increase in height</span></p>', '<p><span style="font-size: small;">remains unaffected with the change in height</span></p>', '<p><span style="font-size: small;">first increases, and then decreases with increase in height</span></p>', 'ans2', 2, 7, 0, '', '', '', '', '', '', 1, '', '', 'N'),
(140, 9, '<p><span style="font-size: small;">Which of the following preventive measures&nbsp;<strong>cannot</strong>&nbsp;be attributed to roadside noise pollution?</span></p>', '<p><span style="font-size: small;">Plantation on the roadside</span></p>', '<p><span style="font-size: small;">Installing silencers in vehicles</span></p>', '<p><span style="font-size: small;">Regular servicing of engines</span></p>', '<p><span style="font-size: small;">Smoothening of roads</span></p>', 'ans4', 2, 7, 0, '', '', '', '', '', '', 1, '', '', 'N'),
(141, 9, '<p><span style="font-size: small;">An arrow is made streamline in shape. During motion, this helps to reduce</span></p>', '<p><span style="font-size: small;">drag</span></p>', '<p><span style="font-size: small;">pressure</span></p>', '<p><span style="font-size: small;">its weight</span></p>', '<p><span style="font-size: small;">its density</span></p>', 'ans1', 2, 7, 0, '', '', '', '', '', '', 1, '', '', 'N'),
(142, 9, '<p><span style="font-size: small;">Sound produced by musical instruments</span></p>', '<p><span style="font-size: small;">cannot be louder</span></p>', '<p><span style="font-size: small;">cannot be dangerous</span></p>', '<p><span style="font-size: small;">can attribute to air pollution</span></p>', '<p><span style="font-size: small;">can attribute to noise pollution</span></p>', 'ans4', 2, 7, 0, '', '', '', '', '', '', 1, '', '', 'N'),
(143, 9, '<p><span style="font-size: small;">Four aeroplanes&nbsp;<strong>I</strong>,&nbsp;<strong>II</strong>,&nbsp;<strong>III</strong>, and&nbsp;<strong>IV</strong>&nbsp;of same masses and similar shapes are moving in air. Speeds of these aeroplanes are&nbsp;<em>v</em><sub>1</sub>,&nbsp;<em>v</em><sub>2</sub>,&nbsp;<em>v</em><sub>3</sub>, and<em>v</em><sub>4</sub>&nbsp;respectively, where&nbsp;<em>v</em><sub>1</sub>&lt;&nbsp;<em>v</em><sub>2</sub>&nbsp;&lt;&nbsp;<em>v</em><sub>3</sub>&nbsp;&lt;&nbsp;<em>v</em><sub>4.</sub></span></p><br />\r\n<p><span style="font-size: small;">The maximum drag is experienced by aeroplane</span></p>', '<p><span style="font-size: small;">I</span></p>', '<p><span style="font-size: small;">II</span></p>', '<p><span style="font-size: small;">III</span></p>', '<p><span style="font-size: small;">IV</span></p>', 'ans4', 2, 7, 0, '', '', '', '', '', '', 1, '', '', 'N'),
(144, 9, '<p><span style="font-size: small;">Rohan is playing with a rubber sucker. He presses the sucker hard on a smooth ground. Hence, it sticks to the ground. When he tries to pull the sucker from the ground, he finds that it requires a large force to separate the sucker from the ground.</span></p><br />\r\n<p><span style="font-size: small;">The reason behind the given fact is that the</span></p>', '<p><span style="font-size: small;">large atmospheric pressure is acting on the sucker</span></p>', '<p><span style="font-size: small;">sucker gets permanently fixed with the ground</span></p>', '<p><span style="font-size: small;">ground also pulls the sucker with a large force</span></p>', '<p><span style="font-size: small;">sucker absorbs the applied force</span></p>', 'ans1', 2, 7, 0, '', '', '', '', '', '', 1, '', '', 'N'),
(145, 9, '<p><span style="font-size: small;">Televisions and music systems attribute to excessive noise in the surroundings. If a person is exposed to such excessive noise for a relatively long time, then he might suffer from hearing loss.</span></p><br />\r\n<p><span style="font-size: small;">The noise that is produced by TVs and music systems may be controlled by</span></p>', '<p><span style="font-size: small;">installing silencers in them</span></p>', '<p><span style="font-size: small;">running them at nights only</span></p>', '<p><span style="font-size: small;">running them at low volumes</span></p>', '<p><span style="font-size: small;">installing digital devices in them</span></p>', 'ans3', 2, 7, 0, '', '', '', '', '', '', 1, '', '', 'N'),
(146, 9, '<p><span style="font-size: small;">A fish can move very fast in water because of the streamline shape of its body.</span></p><br />\r\n<p><span style="font-size: small;">The streamline shape of a fish helps it to reduce</span></p>', '<p><span style="font-size: small;">its weight</span></p>', '<p><span style="font-size: small;">the drag</span></p>', '<p><span style="font-size: small;">its density</span></p>', '<p><span style="font-size: small;">the pressure</span></p>', 'ans2', 2, 7, 0, '', '', '', '', '', '', 1, '', '', 'N'),
(147, 9, '<p><span style="font-size: small;">The drag experienced by an object moving in a liquid&nbsp;<strong>does not</strong>&nbsp;depend on the</span></p>', '<p><span style="font-size: small;">shape of the object</span></p>', '<p><span style="font-size: small;">speed of the object</span></p>', '<p><span style="font-size: small;">colour of the liquid</span></p>', '<p><span style="font-size: small;">nature of the liquid</span></p>', 'ans3', 2, 7, 0, '', '', '', '', '', '', 1, '', '', 'N'),
(148, 9, '<p><span style="font-size: small;">The given figure shows three plastic bottles interconnected through two pipes. Water is filled in each bottle to the same height. Bottle&nbsp;<strong>I&nbsp;</strong>is then closed in such a manner that no air is able to enter it.</span></p><br />\r\n<p><span style="font-size: small;">If a stone is dropped in bottle&nbsp;<strong>III</strong>, then the water level will increase in</span></p>', '<p><span style="font-size: small;">bottle&nbsp;<strong>III</strong>&nbsp;only</span></p>', '<p><span style="font-size: small;">both bottles<strong>&nbsp;I</strong>&nbsp;and&nbsp;<strong>II</strong></span></p>', '<p><span style="font-size: small;">both bottles&nbsp;<strong>II&nbsp;</strong>and&nbsp;<strong>III</strong></span></p>', '<p><span style="font-size: small;">bottles&nbsp;<strong>I</strong>,&nbsp;<strong>II</strong>,and&nbsp;<strong>III</strong>&nbsp;equally</span></p>', 'ans3', 2, 7, 0, '', '7a3a086e24f8981b389e35a7843e4245.jpg', '', '', '', '', 1, '', '', 'N'),
(149, 9, '<p><span style="font-size: small;">The part of an ear that is affected by excessive noise is the</span></p>', '<p><span style="font-size: small;">pinna</span></p>', '<p><span style="font-size: small;">eardrum</span></p>', '<p><span style="font-size: small;">ear canal</span></p>', '<p><span style="font-size: small;">eustachian tube</span></p>', 'ans2', 2, 7, 0, '', '', '', '', '', '', 1, '', '', 'N'),
(150, 9, '<p><span style="font-size: small;">In a cycling race, it is observed that a cyclist normally bends his body forward (as shown in the given figure).</span></p><br />\r\n<p><span style="font-size: small;">The cyclist bends in order to</span></p>', '<p><span style="font-size: small;">feel comfortable</span></p>', '<p><span style="font-size: small;">reduce his weight</span></p>', '<p><span style="font-size: small;">reduce the air drag</span></p>', '<p><span style="font-size: small;">increase energy consumption</span></p>', 'ans3', 2, 7, 0, '', '757cba5b55050f9fd6a5478d0be85c23.jpg', '', '', '', '', 1, '', '', 'N');
INSERT INTO `question_master` (`ques_id`, `test_id`, `ques`, `ans1`, `ans2`, `ans3`, `ans4`, `correct`, `subject_id`, `topic_id`, `sub_topic_id`, `level`, `ques_image`, `ans1_img`, `ans2_img`, `ans3_img`, `ans4_img`, `marks`, `isVisible`, `solution`, `isTextBox`) VALUES
(151, 9, '<p><span style="font-size: small;">Romesh is climbing a mountain. While climbing, he continuously takes the reading of atmospheric pressure using a barometer. </span></p><br />\r\n<p><span style="font-size: small;">While climbing, Romesh will&nbsp;<strong>most</strong>&nbsp;probably observe that the height of the mercury column in the barometer</span></p>', '<p><span style="font-size: small;">keeps decreasing</span></p>', '<p><span style="font-size: small;">keeps increasing</span></p>', '<p><span style="font-size: small;">increases first and then decreases</span></p>', '<p><span style="font-size: small;">decreases first and then increases</span></p>', 'ans1', 2, 7, 0, '', '', '', '', '', '', 1, '', '', 'N'),
(152, 9, '<p><span style="font-size: small;">The presence of excessive sound in surroundings is termed as</span></p>', '<p><span style="font-size: small;">loudness</span></p>', '<p><span style="font-size: small;">shrillness</span></p>', '<p><span style="font-size: small;">music</span></p>', '<p><span style="font-size: small;">noise</span></p>', 'ans4', 2, 7, 0, '', '', '', '', '', '', 1, '', '', 'N'),
(153, 9, '<p><span style="font-size: small;">The given figure shows a ball rolling down an inclined plane. The direction of motion of the ball is represented by arrow&nbsp;<strong>I</strong>.</span></p><br />\r\n<p><span style="font-size: small;">Arrows&nbsp;<strong>II</strong>&nbsp;and&nbsp;<strong>III</strong>&nbsp;respectively represent the directions of</span></p>', '<p><span style="font-size: small;">rolling&nbsp;frictional force and gravitational force</span></p>', '<p><span style="font-size: small;">gravitational force and normal reaction</span></p>', '<p><span style="font-size: small;">rolling frictional force&nbsp;and air friction</span></p>', '<p><span style="font-size: small;">air&nbsp;friction and normal reaction</span></p>', 'ans3', 2, 7, 0, '', '21a69e232a02c270e93d042844d03237.jpg', '', '', '', '', 1, '', '', 'N'),
(154, 9, '<p><span style="font-size: small;">The number of air molecules in the atmosphere decreases with an increase in&nbsp;height and vice versa. This causes</span></p>', '<p><span style="font-size: small;">an increase in atmospheric pressure with an increase in height</span></p>', '<p><span style="font-size: small;">a decrease in atmospheric pressure with an increase in height</span></p>', '<p><span style="font-size: small;">an increase in wind&nbsp;speed with an increase in height</span></p>', '<p><span style="font-size: small;">a decrease in wind speed with an increase in height</span></p>', 'ans2', 2, 7, 0, '', '', '', '', '', '', 1, '', '', 'N'),
(155, 9, '<p><span style="font-size: small;">With reference to&nbsp;the human ear, exposure to excessive sound may damage its</span></p>', '<p><span style="font-size: small;">pinna</span></p>', '<p><span style="font-size: small;">eardrum</span></p>', '<p><span style="font-size: small;">ear canal</span></p>', '<p><span style="font-size: small;">Eustachian tube</span></p>', 'ans2', 2, 7, 0, '', '', '', '', '', '', 1, '', '', 'N'),
(156, 10, '<p><span style="font-size: small;">A cyclist rides his bicycle with a uniform speed of 2.2 m/s. He completes one revolution around a circular track in 20 s.</span></p><br />\r\n<p><span style="font-size: small;">What is the radius of the track?</span></p>', '<p><span style="font-size: small;">3.5 m</span></p>', '<p><span style="font-size: small;">7 m</span></p>', '<p><span style="font-size: small;">10.5 m</span></p>', '<p><span style="font-size: small;">14 m</span></p>', 'ans2', 2, 8, 0, '', '', '', '', '', '', 1, '', '', 'N'),
(157, 10, '<p><span style="font-size: small;">Which of the following statements is&nbsp;<strong>false</strong>&nbsp;regarding buoyant and gravitational forces?</span></p>', '<p><span style="font-size: small;">Buoyant force acts perpendicularly to the force of gravitation.</span></p>', '<p><span style="font-size: small;">Buoyant and gravitational forces are independent of each other.</span></p>', '<p><span style="font-size: small;">Buoyant and gravitational forces act parallel and in the same direction.</span></p>', '<p><span style="font-size: small;">Buoyant and gravitational forces act parallel but in opposite directions.</span></p>', 'ans4', 2, 8, 0, '', '', '', '', '', '', 1, '', '', 'N'),
(158, 10, '<p><span style="font-size: small;">Coin&nbsp;has a mass of&nbsp;50 g and is moving with a velocity of&nbsp;2 m/s. It collides with another coin&nbsp;having a mass of 40 g. The second&nbsp;is moving with a velocity of 1 m/s in the same direction. The velocity of&nbsp;first coin&nbsp;after collision reduces to 1.5 m/s.</span></p><br />\r\n<p><span style="font-size: small;">What is the velocity of&nbsp;the second coin<strong>&nbsp;</strong>after the collision?</span></p>', '<p><span style="font-size: small;">1.625 m/s</span></p>', '<p><span style="font-size: small;">1.85 m/s</span></p>', '<p><span style="font-size: small;">2.225 m/s</span></p>', '<p><span style="font-size: small;">2.45 m/s</span></p>', 'ans1', 2, 8, 0, '', '', '', '', '', '', 1, '', '', 'N'),
(159, 10, '<p><span style="font-size: small;">A cyclist is moving around a circular track of radius 35 m. He covers a round of the track in 33 seconds. Take &prod;=22/7</span></p><br />\r\n<p><span style="font-size: small;">What is the&nbsp;speed of the cyclist?</span></p>', '<p><span style="font-size: small;">4.67 m/s</span></p>', '<p><span style="font-size: small;">5.67 m/s</span></p>', '<p><span style="font-size: small;">6.67 m/s</span></p>', '<p><span style="font-size: small;">7.67 m/s</span></p>', 'ans3', 2, 8, 0, '', '', '', '', '', '', 1, '', '', 'N'),
(160, 10, '<p><span style="font-size: small;">A body whose weight in air is&nbsp;<em>W</em>'' is completely immersed in water. Its weight in water is&nbsp;<em>W</em>&Prime;.</span></p><br />\r\n<p><span style="font-size: small;">What is the amount of water displaced by the body?</span></p>', '<p><span style="font-size: small;"><em>W</em>'' +&nbsp;<em>W</em>&Prime;</span></p>', '<p><span style="font-size: small;"><em>W</em>''</span></p>', '<p><span style="font-size: small;">2<em>W</em>''</span></p>', '<p><span style="font-size: small;"><em>W</em>'' -&nbsp;<em>W</em>&Prime;</span></p>', 'ans4', 2, 8, 0, '', '', '', '', '', '', 1, '', '', 'N'),
(161, 10, '<p><span style="font-size: small;">A tennis ball of mass&nbsp;<em>m</em>, moving with velocity&nbsp;<em>v</em>,collides with a wall in such a way that its total momentum remains conserved in the collision.</span></p><br />\r\n<p><span style="font-size: small;">What is the velocity with which the ball will bounce back from the wall?</span></p>', '<p><em><span style="font-size: small;">v/4</span></em></p>', '<p><em><span style="font-size: small;">v/2</span></em></p>', '<p><em><span style="font-size: small;">v</span></em></p>', '<p><span style="font-size: small;">2v</span></p>', 'ans3', 2, 8, 0, '', '', '', '', '', '', 1, '', '', 'N'),
(162, 10, '<p><span style="font-size: small;">Jatin drops a small metal bar in water. He observes that the metal bar immediately sinks in water, as shown in the given figure.</span></p><br />\r\n<p>&nbsp;</p><br />\r\n<p><span style="font-size: small;">The given metal bar sinks because the</span></p>', '<p><span style="font-size: small;">buoyant force becomes zero</span></p>', '<p><span style="font-size: small;">buoyant force becomes very high</span></p>', '<p><span style="font-size: small;">force of gravitation is less than the buoyant force</span></p>', '<p><span style="font-size: small;">force of gravitation is greater than the buoyant force</span></p>', 'ans4', 2, 8, 0, '', '37c30b2b10d3c0790c98310d2d13d3a4.jpg', '', '', '', '', 1, '', '', 'N'),
(163, 10, '<p><span style="font-size: small;">Ball&nbsp;<strong>I</strong>&nbsp;has a mass of 250 g and is moving with a velocity of 5 m/s. It collides with ball&nbsp;<strong>II&nbsp;</strong>having a mass of 400 g. Ball&nbsp;<strong>II</strong>&nbsp;is moving with a velocity of 1 m/s in the same direction. The velocity of ball&nbsp;<strong>I</strong>&nbsp;after collision reduces to 3 m/s.</span></p><br />\r\n<p><span style="font-size: small;">What is the velocity of ball&nbsp;<strong>II&nbsp;</strong>after the collision?</span></p>', '<p><span style="font-size: small;">1.75 m/s</span></p>', '<p><span style="font-size: small;">2.00 m/s</span></p>', '<p><span style="font-size: small;">2.25 m/s</span></p>', '<p><span style="font-size: small;">2.50 m/s</span></p>', 'ans3', 2, 8, 0, '', '', '', '', '', '', 1, '', '', 'N'),
(164, 10, '<p><span style="font-size: small;">A cyclist moves around a circular track with a speed of 4.4 ms<sup>&minus;1</sup>. The cyclist covers five rounds in 25 minutes.</span></p><br />\r\n<p><span style="font-size: small;">What is the radius of the circular track?</span></p>', '<p><span style="font-size: small;">140 m</span></p>', '<p><span style="font-size: small;">180 m</span></p>', '<p><span style="font-size: small;">210 m</span></p>', '<p><span style="font-size: small;">240 m</span></p>', 'ans3', 2, 8, 0, '', '', '', '', '', '', 1, '', '', 'N'),
(165, 10, '<p><span style="font-size: small;">According to Archimedes&rsquo; principle, when a body is immersed in a liquid, it experiences <em><strong>i</strong></em> force that is <em><strong>ii</strong></em> the weight of the liquid displaced by it.</span></p><br />\r\n<p><span style="font-size: small;">The information in which alternative completes the given statement?</span></p>', '<p><img src="http://s1.postimg.org/907kweosv/10a.jpg" alt="" width="186" height="92" /></p>', '<p><img src="http://s22.postimg.org/6ncb5g8a9/10b.jpg" alt="" width="186" height="92" /></p>', '<p><img src="http://s13.postimg.org/5w15z144n/10c.jpg" alt="" width="186" height="91" /></p>', '<p><img src="http://s29.postimg.org/empzq3o47/10d.jpg" alt="" width="185" height="91" /></p>', 'ans2', 2, 8, 0, '', '', '', '', '', '', 1, '', '', 'N'),
(166, 10, '<p><span style="font-size: small;">A ball of mass&nbsp;<em>m</em>I,moving with velocity&nbsp;<em>u</em>I,collides with another ball of mass&nbsp;<em>m</em>II,moving with velocity&nbsp;<em>u</em>II,<sub>&nbsp;</sub>in the same direction. After collision, these balls move with<sub>&nbsp;</sub>velocities&nbsp;<em>v</em>I&nbsp;and&nbsp;<em>v</em>II&nbsp;respectively.</span></p><br />\r\n<p><span style="font-size: small;">According to the law of conservation of momentum, the initial and final momentums of the balls are related as</span></p>', '<p><img src="http://s30.postimg.org/jydzlsb7x/11a.jpg" alt="" width="173" height="24" /></p>', '<p><img src="http://s17.postimg.org/w6q5npt6j/11b.jpg" alt="" width="173" height="24" /></p>', '<p><img src="http://s12.postimg.org/4e0s5jjnt/11c.jpg" alt="" width="172" height="24" /></p>', '<p><img src="http://s15.postimg.org/ba47z9dzr/11d.jpg" alt="" width="173" height="24" /></p>', 'ans4', 2, 8, 0, '', '', '', '', '', '', 1, '', '', 'N'),
(167, 10, '<p><span style="font-size: small;">A bullet of mass 10 g is fired from a pistol of mass 2.5 kg with a velocity of 300 m/s.</span></p><br />\r\n<p><span style="font-size: small;">What is the recoil velocity of the bullet?</span></p>', '<p><span style="font-size: small;">2.4 m/s</span></p>', '<p><span style="font-size: small;">1.2 m/s</span></p>', '<p><span style="font-size: small;">&minus;1.2 m/s</span></p>', '<p><span style="font-size: small;">&minus;2.4 m/s</span></p>', 'ans3', 2, 8, 0, '', '', '', '', '', '', 1, '', '', 'N'),
(168, 10, '<p><span style="font-size: small;">A body&nbsp;having a mass of 100 g in air is immersed in water. It is observed that this body displaces 20 g of water</span></p><br />\r\n<p><span style="font-size: small;">What is the weight of the body in water?</span></p>', '<p><span style="font-size: small;">0.196 N</span></p>', '<p><span style="font-size: small;">0.490 N</span></p>', '<p><span style="font-size: small;">0.784 N</span></p>', '<p><span style="font-size: small;">0.980 N</span></p>', 'ans3', 2, 8, 0, '', '', '', '', '', '', 1, '', '', 'N'),
(169, 10, '<p><span style="font-size: small;">A ball having a mass 400 g is moving with a uniform velocity of 2 m/s. It collides head on with another ball having half its mass and half its velocity. Both the balls are travelling in the same direction. After collision, the two balls get stuck with each other.</span></p><br />\r\n<p><span style="font-size: small;">What is the velocity with which the system of the two balls moves after collision?</span></p>', '<p><span style="font-size: small;">0.60 m/s</span></p>', '<p><span style="font-size: small;">1.67 m/s</span></p>', '<p><span style="font-size: small;">4.23 m/s</span></p>', '<p><span style="font-size: small;">4.33 m/s</span></p>', 'ans2', 2, 8, 0, '', '', '', '', '', '', 1, '', '', 'N'),
(170, 10, '<p>A body starts from rest and moves along a straight line. Its displacement is directly proportional</p>', '<p><span style="font-size: small;">1:3</span></p>', '<p><span style="font-size: small;">1:9</span></p>', '<p><span style="font-size: small;">3:1</span></p>', '<p><span style="font-size: small;">9:1</span></p>', 'ans1', 2, 8, 0, '', 'b45cc82d290da7088f3d0d9f8653debe.JPG', '', '', '', '', 1, '', '', 'N'),
(171, 10, '<p><span style="font-size: small;">At the instant traffic light&nbsp;1 turns green, a car (at rest) starts moving with a constant acceleration of 1 m/s2. This car crosses traffic light 2 with a velocity of 20 m/s.</span></p><br />\r\n<p><span style="font-size: small;">What is the distance between the two traffic lights?</span></p>', '<p><span style="font-size: small;">140 m</span></p>', '<p><span style="font-size: small;">160 m</span></p>', '<p><span style="font-size: small;">180 m</span></p>', '<p><span style="font-size: small;">200 m</span></p>', 'ans4', 2, 8, 0, '', '', '', '', '', '', 1, '', '', 'N'),
(172, 10, '<p><span style="font-size: small;">If a body whose weight in air is&nbsp;<em>W</em>1&nbsp;and the same in water is&nbsp;<em>W</em>2, then the ratio W1/W2 will be.</span></p>', '<p><span style="font-size: small;">less than&nbsp;one</span></p>', '<p><span style="font-size: small;">equal to zero</span></p>', '<p><span style="font-size: small;">equal to one</span></p>', '<p><span style="font-size: small;">greater than one</span></p>', 'ans4', 2, 8, 0, '', '', '', '', '', '', 1, '', '', 'N'),
(173, 10, '<p><span style="font-size: small;">A metal ball of mass 250 grams is moving with a velocity,&nbsp;<em>v</em>. It collides with a stationary putty ball of mass 300 grams. As a result of the collision, the balls get stuck together and move in such a way that the system covers a distance of one metre in 2.5 seconds.</span></p><br />\r\n<p><span style="font-size: small;">What is the velocity of the metal ball before collision?</span></p>', '<p><span style="font-size: small;">0.22 m/s</span></p>', '<p><span style="font-size: small;">0.44 m/s</span></p>', '<p><span style="font-size: small;">0.66 m/s</span></p>', '<p><span style="font-size: small;">0.88 m/s</span></p>', 'ans4', 2, 8, 0, '', '', '', '', '', '', 1, '', '', 'N'),
(174, 10, '<p><span style="font-size: small;">A bus is moving with a uniform&nbsp;velocity of 54 km/h. The driver applies the brakes, thereby producing a uniform retardation and bringing the bus to rest in two minutes.</span></p><br />\r\n<p><span style="font-size: small;">What is the distance travelled by the bus before coming to rest?</span></p>', '<p><span style="font-size: small;">225 m</span></p>', '<p><span style="font-size: small;">450 m</span></p>', '<p><span style="font-size: small;">675 m</span></p>', '<p><span style="font-size: small;">900 m</span></p>', 'ans4', 2, 8, 0, '', '', '', '', '', '', 1, '', '', 'N'),
(175, 10, '<p><span style="font-size: small;">Ravi&nbsp;takes two spring balances. He attaches one end of spring balance&nbsp;<strong>I</strong>&nbsp;to a rigid wall and its free end to spring balance&nbsp;<strong>II</strong>, as shown in the given figure. He then pulls the free end of spring balance&nbsp;<strong>II</strong>&nbsp;with a force of 5 N.</span></p><br />\r\n<p><span style="font-size: small;">What will be the respective readings on spring balances&nbsp;<strong>I</strong>&nbsp;and&nbsp;<strong>II</strong>?</span></p>', '<p><span style="font-size: small;">2.5 N and 2.5 N</span></p>', '<p><span style="font-size: small;">2.5 N and 5 N</span></p>', '<p><span style="font-size: small;">5 N and 2.5 N</span></p>', '<p><span style="font-size: small;">5 N and 5 N</span></p>', 'ans4', 2, 8, 0, '', '7279c7d0b092dabbbc95bfadf94f3f43.jpg', '', '', '', '', 1, '', '', 'N'),
(176, 11, '<p><span style="font-size: small;">A fan of resistance 400 &Omega; is connected to a 220 V power supply.</span></p><br />\r\n<p><span style="font-size: small;">The rate of energy consumed by the bulb is ?</span></p>', '<p><span style="font-size: small;">65 W</span></p>', '<p><span style="font-size: small;">86 W</span></p>', '<p><span style="font-size: small;">121 W</span></p>', '<p><span style="font-size: small;">148 W</span></p>', 'ans3', 2, 9, 0, '', '', '', '', '', '', 1, '', '', 'N'),
(177, 11, '<p><span style="font-size: small;">A ray of light is travelling from air to water having a refractive index of 4/3.The velocity, frequency, and wavelength of light in air are represented as c,&nbsp;<em>f</em>, and &lambda; respectively.</span></p><br />\r\n<p><span style="font-size: small;">Which of the following statements about the ray of light travelling in water is true?</span></p>', '<p><span style="font-size: small;">The velocity of light in water is 3c/4</span></p>', '<p><span style="font-size: small;">The frequency of light in water is 4f/3</span></p>', '<p><span style="font-size: small;">The wavelength of light in water is 3&lambda;/4</span></p>', '<p><span style="font-size: small;">The wavelength of light in water is 4&lambda;/3</span></p>', 'ans4', 2, 9, 0, '', '', '', '', '', '', 1, '', '', 'N'),
(178, 11, '<p><span style="font-size: small;">The scattering of light by small particles of a colloidal solution cause the light to become visible.</span></p><br />\r\n<p><span style="font-size: small;">The scattering of light takes place by particles having a size less than</span></p>', '<p><span style="font-size: small;">the wavelength of the light used</span></p>', '<p><span style="font-size: small;">twice the wavelength of the light used</span></p>', '<p><span style="font-size: small;">one-half of the wavelength of the light used</span></p>', '<p><span style="font-size: small;">one-twentieth of the wavelength of the light used</span></p>', 'ans4', 2, 9, 0, '', '', '', '', '', '', 1, '', '', 'N'),
(179, 11, '<p><span style="font-size: small;">A ceiling fan of 40 W is connected in parallel connection with a fluorescent light bulb of 30 W. They both are connected to a supply voltage of 220 V.</span></p><br />\r\n<p><span style="font-size: small;">The equivalent resistance of the given combination is</span></p>', '<p><span style="font-size: small;">132.8 &Omega;</span></p>', '<p><span style="font-size: small;">341.2 &Omega;</span></p>', '<p><span style="font-size: small;">691.4 &Omega;</span></p>', '<p><span style="font-size: small;">724.6 &Omega;</span></p>', 'ans3', 2, 9, 0, '', '', '', '', '', '', 1, '', '', 'N'),
(180, 11, '<p><span style="font-size: small;">An image having a size of 10 cm is formed at a distance of 8 cm from a concave lens when a pencil is placed before it. The power of the lens is &shy;10 D.</span></p><br />\r\n<p><span style="font-size: small;">What is the size of the given pencil?</span></p>', '<p><span style="font-size: small;">10 cm</span></p>', '<p><span style="font-size: small;">25 cm</span></p>', '<p><span style="font-size: small;">35 cm</span></p>', '<p><span style="font-size: small;">50 cm</span></p>', 'ans4', 2, 9, 0, '', '', '', '', '', '', 1, '', '', 'N'),
(181, 11, '<p><span style="font-size: small;">The colour of the sky when viewed from the surface of the moon appears to be</span></p>', '<p><span style="font-size: small;">red</span></p>', '<p><span style="font-size: small;">blue</span></p>', '<p><span style="font-size: small;">white</span></p>', '<p><span style="font-size: small;">black</span></p>', 'ans4', 2, 9, 0, '', '', '', '', '', '', 1, '', '', 'N'),
(182, 11, '<p><span style="font-size: small;">Romesh uses his laptop of 50 W daily for 1 h in the month of December. The total bill that he pays for that month is Rs. 105. The cost of per kWh energy is Rs. 2.88.</span></p><br />\r\n<p><span style="font-size: small;">What percentage of the electric bill is due to the usage of his laptop?</span></p>', '<p><span style="font-size: small;">2.12 %</span></p>', '<p><span style="font-size: small;">2.23 %</span></p>', '<p><span style="font-size: small;">4.25 %</span></p>', '<p><span style="font-size: small;">4.46 %</span></p>', 'ans3', 2, 9, 0, '', '', '', '', '', '', 1, '', '', 'N'),
(183, 11, '<p><span style="font-size: small;">An image is formed on a screen placed 50 cm from a lens. The distance between the object and the lens is 40 cm.</span></p><br />\r\n<p><span style="font-size: small;">What is the power of the given lens?</span></p>', '<p><span style="font-size: small;">1.25 D</span></p>', '<p><span style="font-size: small;">&minus;1.25 D</span></p>', '<p><span style="font-size: small;">4.50 D</span></p>', '<p><span style="font-size: small;">&minus;4.50 D</span></p>', 'ans3', 2, 9, 0, '', '', '', '', '', '', 1, '', '', 'N'),
