(188, 11, '<p><span style="font-size: small;">Electric meters are fixed in houses or buildings to measure the amount of energy consumed. It measures this energy in terms of &lsquo;unit&rsquo;.</span></p><br />\r\n<p><span style="font-size: small;">One &lsquo;unit&rsquo; is equivalent to</span></p>', '<p><span style="font-size: small;">1 J of energy</span></p>', '<p><span style="font-size: small;">36 J of energy</span></p>', '<p><span style="font-size: small;">1000 J of energy</span></p>', '<p><span style="font-size: small;">3600000 J of energy</span></p>', 'ans4', 2, 9, 0, '', '', '', '', '', '', 1, '', '', 'N'),
(189, 11, '<p><span style="font-size: small;">A convex lens of focal length 20 cm is placed at a distance of 50 cm from a wall. A 15 cm long pencil is placed before the lens. A sharp magnified image is obtained on the wall.</span></p><br />\r\n<p><span style="font-size: small;">The size of the image of the pencil is</span></p>', '<p><span style="font-size: small;">22.5 cm</span></p>', '<p><span style="font-size: small;">27.5 cm</span></p>', '<p><span style="font-size: small;">35 cm</span></p>', '<p><span style="font-size: small;">70 cm</span></p>', 'ans1', 2, 9, 0, '', '', '', '', '', '', 1, '', '', 'N'),
