(191, 11, '<p><span style="font-size: small;">Three bulbs are connected to a power supply of 30 V as shown in the given figure.</span></p><br />\r\n<p><span style="font-size: small;">Which of the following statements about the power consumption of the bulbs is correct?</span></p>', '<p><span style="font-size: small;"><strong>B1</strong>&nbsp;and&nbsp;<strong>B3</strong>&nbsp;consume equal amount of power since they are connected in series.</span></p>', '<p><span style="font-size: small;"><strong>B2</strong>&nbsp;and&nbsp;<strong>B3</strong>&nbsp;consume equal amount of power since their resistance values are equal.</span></p>', '<p><span style="font-size: small;"><strong>B3</strong>&nbsp;consumes more power than&nbsp;<strong>B2&nbsp;</strong>since the latter is connected in parallel with&nbsp;<strong>B2</strong>.</span></p>', '<p><span style="font-size: small;"><strong>B3&nbsp;</strong>consumes more power than&nbsp;<strong>B2&nbsp;</strong>since the latter has lower resistance value.</span></p>', 'ans3', 2, 9, 0, '', 'ff1afb4009964caba31cf2d2cb7e855d.jpg', '', '', '', '', 1, '', '', 'N'),
