(196, 12, '<p><span style="font-size: small;">Which of the following equations represents a single displacement reaction?</span></p>', '<p><img src="http://s4.postimg.org/srmam6rt9/image.jpg" alt="" width="191" height="28" /></p>', '<p><img src="http://s27.postimg.org/62qfhjq9f/image.jpg" alt="" width="201" height="28" /></p>', '<p><img src="http://s8.postimg.org/6im78di5x/image.jpg" alt="" width="263" height="28" /></p>', '<p><img src="http://s27.postimg.org/7vtc5vbg3/image.jpg" alt="" width="296" height="28" /></p>', 'ans3', 3, 10, 0, '', '', '', '', '', '', 1, '', '', 'N'),
(197, 12, '<p><span style="font-size: small;">Petroleum is formed from buried</span></p>', '<p><span style="font-size: small;">terrestrial organisms</span></p>', '<p><span style="font-size: small;">sea organisms</span></p>', '<p><span style="font-size: small;">animals</span></p>', '<p><span style="font-size: small;">plants</span></p>', 'ans2', 3, 10, 0, '', '', '', '', '', '', 1, '', '', 'N'),
(198, 12, '<p><span style="font-size: small;">The given graphs show the conductivities and reactivities (with air and water) of a few substances that are used in our daily lives.</span></p><br />\r\n<p><span style="font-size: small;">Which of the following statements is correct?</span></p>', '<p><span style="font-size: small;"><strong>X</strong>&nbsp;and&nbsp;<strong>V</strong>&nbsp;could represent plastics.</span></p>', '<p><span style="font-size: small;"><strong>X</strong>&nbsp;and&nbsp;<strong>U</strong>&nbsp;could represent natural fibres.</span></p>', '<p><span style="font-size: small;"><strong>Y</strong>&nbsp;and<strong>&nbsp;V&nbsp;</strong>could represent animal fibres.</span></p>', '<p><span style="font-size: small;"><strong>Y</strong>&nbsp;and&nbsp;<strong>X</strong>&nbsp;could represent synthetic fibres.</span></p>', 'ans1', 3, 10, 0, '', '', '', '', '', '', 1, '', '', 'N'),
(199, 12, '<p><span style="font-size: small;">Three test tubes were taken and labelled as X, Y, and Z. To each of the test tubes, some amount of aluminium foil was added. Then, H<sub>2</sub>SO<sub>4</sub> was added to X, CuSO<sub>4</sub> solution to Y, and zinc sulphate solution to Z.</span></p><br />\r\n<p><span style="font-size: small;">In the given activity, hydrogen gas will be produced in</span></p>', '<p><span style="font-size: small;">test tube X only</span></p>', '<p><span style="font-size: small;">test tube&nbsp;Y only</span></p>', '<p><span style="font-size: small;">test tubes&nbsp;X and Y both</span></p>', '<p><span style="font-size: small;">test tubes&nbsp;X and Z both</span></p>', 'ans1', 3, 10, 0, '', '', '', '', '', '', 1, '', '', 'N'),
(200, 12, '<p><span style="font-size: small;">Which of the following illustrations correctly depicts the deposits of petroleum and natural gas inside the Earth?</span></p>', '<p><img src="http://s27.postimg.org/eht12ca7n/image.jpg" alt="" width="200" height="124" /></p>', '<p><img src="http://s30.postimg.org/riapb4jdd/image.jpg" alt="" width="200" height="124" /></p>', '<p><img src="http://s22.postimg.org/acxnlu4g1/image.jpg" alt="" width="200" height="124" /></p>', '<p><img src="http://s30.postimg.org/5ke8hc4cx/image.jpg" alt="" width="200" height="124" /></p>', 'ans3', 3, 10, 0, '', '', '', '', '', '', 1, '', '', 'N'),
(201, 12, '<p>The following four statements depict the properties of plastics when compared to metals.</p><br />\r\n<p><strong>I:</strong><strong>&nbsp;</strong>Iron containers are preferred over plastic containers to store chemicals.</p><br />\r\n<p><strong>II:</strong><strong>&nbsp;</strong>Plastics are generally cheaper than metals.</p><br />\r\n<p><strong>III:</strong><strong>&nbsp;</strong>Plastics are preferred over metals for making handles of cooking utensils.</p><br />\r\n<p><strong>IV:&nbsp;</strong>Electrical wires are made of plastics having a metal covering.</p><br />\r\n<p>Which two statements are&nbsp;<strong>incorrect</strong>?</p>', '<p><span style="font-size: small;"><strong>I</strong><strong>&nbsp;</strong>and&nbsp;<strong>II</strong></span></p>', '<p><span style="font-size: small;"><strong>III</strong><strong>&nbsp;</strong>and<strong>&nbsp;IV</strong></span></p>', '<p><span style="font-size: small;"><strong>II</strong>&nbsp;and&nbsp;<strong>III</strong></span></p>', '<p><span style="font-size: small;"><strong>I</strong>&nbsp;and&nbsp;<strong>IV</strong></span></p>', 'ans4', 3, 10, 0, '', '', '', '', '', '', 1, '', '', 'N'),
(202, 12, '<p><span style="font-size: small;">Which of the following statements is true regarding the properties of plastics?</span></p>', '<p><span style="font-size: small;">Plastics react with air and moisture from atmosphere.</span></p>', '<p><span style="font-size: small;">Plastics are good conductors of electricity.</span></p>', '<p><span style="font-size: small;">Uniforms of firemen have a coating of flame-resistant plastics.</span></p>', '<p><span style="font-size: small;">Metals are lighter than plastics.</span></p>', 'ans3', 3, 10, 0, '', '', '', '', '', '', 1, '', '', 'N'),
(203, 12, '<p><span style="font-size: small;">Some metals are given in the decreasing order of their reactivity:</span></p><br />\r\n<p><span style="font-size: small;"> Magnesium &gt; Zinc &gt; Iron &gt; Lead &gt; Copper &gt; Silver &gt; Gold</span></p><br />\r\n<p><span style="font-size: small;">Which of the following metals can replace lead from lead sulphate solution?</span></p>', '<p><span style="font-size: small;">Gold</span></p>', '<p><span style="font-size: small;">Silver</span></p>', '<p><span style="font-size: small;">Copper</span></p>', '<p><span style="font-size: small;">Magnesium</span></p>', 'ans4', 3, 10, 0, '', '', '', '', '', '', 1, '', '', 'N'),
(204, 12, '<p><span style="font-size: small;">What are the conditions necessary for the formation of petroleum from dead organisms?</span></p>', '<p><span style="font-size: small;">Low temperature, low pressure and absence of air</span></p>', '<p><span style="font-size: small;">Low temperature, low pressure and presence of air</span></p>', '<p><span style="font-size: small;">High temperature, high pressure and absence of air</span></p>', '<p><span style="font-size: small;">High temperature, high pressure and presence of air</span></p>', 'ans3', 3, 10, 0, '', '', '', '', '', '', 1, '', '', 'N'),
(205, 12, '<p><span style="font-size: small;">Which of the following statements about plastics is&nbsp;<strong>not&nbsp;</strong>true?</span></p>', '<p><span style="font-size: small;">Plastics can be&nbsp;moulded&nbsp;into different shapes.</span></p>', '<p><span style="font-size: small;">Plastics are poor conductors of heat and electricity.</span></p>', '<p><span style="font-size: small;">Plastics get corroded on exposure to air and moisture.</span></p>', '<p><span style="font-size: small;">Threads used for stitching wounds are made up of plastics.</span></p>', 'ans3', 3, 10, 0, '', '', '', '', '', '', 1, '', '', 'N'),
(206, 12, '<p><span style="font-size: small;">The products obtained when sodium chloride reacts with silver nitrate are</span></p>', '<p><span style="font-size: small;">Ag, Na, Cl<sub>2</sub>, and NO<sub>2</sub></span></p>', '<p><span style="font-size: small;">Ag, NaNO<sub>3</sub>, and Cl<sub>2</sub></span></p>', '<p><span style="font-size: small;">AgCl, Na, and NO<sub>2</sub></span></p>', '<p><span style="font-size: small;">AgCl and NaNO<sub>3</sub></span></p>', 'ans4', 3, 10, 0, '', '', '', '', '', '', 1, '', '', 'N'),
(207, 12, '<p><span style="font-size: small;">Inside the Earth, deposits of not only water, but also oil and gas are found.</span></p><br />\r\n<p><span style="font-size: small;">The order in which the given substances will be found if a tunnel is drilled into the Earth is</span></p>', '<p><span style="font-size: small;">gas, oil, water</span></p>', '<p><span style="font-size: small;">water, gas, oil</span></p>', '<p><span style="font-size: small;">oil, water, gas</span></p>', '<p><span style="font-size: small;">gas, water, oil</span></p>', 'ans1', 3, 10, 0, '', '', '', '', '', '', 1, '', '', 'N'),
(208, 12, '<p><span style="font-size: small;">Handles of screwdrivers are made up of <strong><em><span style="font-size: medium;">i</span></em></strong> since it is a <strong><em><span style="font-size: medium;">ii</span></em></strong> conductor of electricity.</span></p><br />\r\n<p><span style="font-size: small;">The information in which alternative completes the given statement?</span></p>', '<p><img src="http://s27.postimg.org/5ry8qd5f3/13a.jpg" alt="" width="114" height="92" /></p>', '<p><img src="http://s12.postimg.org/x9x8avthl/13b.jpg" alt="" width="113" height="92" /></p>', '<p><img src="http://s4.postimg.org/ixnmt5u15/13c.jpg" alt="" width="115" height="92" /></p>', '<p><img src="http://s15.postimg.org/tj43qwjgn/13d.jpg" alt="" width="114" height="92" /></p>', 'ans4', 3, 10, 0, '', '', '', '', '', '', 1, '', '', 'N'),
(209, 12, '<p><span style="font-size: small;">Zinc reacts with copper sulphate to produce</span></p>', '<p><span style="font-size: small;">Cu and ZnSO<sub>4</sub></span></p>', '<p><span style="font-size: small;">CuO and ZnSO<sub>4</sub></span></p>', '<p><span style="font-size: small;">Cu, ZnS, and SO<sub>2</sub></span></p>', '<p><span style="font-size: small;">CuO, ZnS, and SO<sub>2</sub></span></p>', 'ans1', 3, 10, 0, '', '', '', '', '', '', 1, '', '', 'N'),
(210, 12, '<p><span style="font-size: small;">Consider the following statements related to petroleum.</span></p><br />\r\n<p><span style="font-size: small;"><strong>I.</strong> It is formed from the remains of dead sea organisms.</span></p><br />\r\n<p><span style="font-size: small;"><strong>II.</strong> It is formed from the remains of dead land organisms.</span></p><br />\r\n<p><span style="font-size: small;"><strong>III.</strong> It is formed under low pressure and temperature.</span></p><br />\r\n<p><span style="font-size: small;">Among the given statements,</span></p>', '<p><span style="font-size: small;">only statement&nbsp;<strong>I</strong>&nbsp;is true</span></p>', '<p><span style="font-size: small;">only statement&nbsp;<strong>III</strong>&nbsp;is true</span></p>', '<p><span style="font-size: small;">both statements&nbsp;<strong>I</strong>&nbsp;and&nbsp;<strong>II</strong>&nbsp;are true</span></p>', '<p><span style="font-size: small;">both statements&nbsp;<strong>II</strong>&nbsp;and&nbsp;<strong>III</strong>&nbsp;are true</span></p>', 'ans1', 3, 10, 0, '', '', '', '', '', '', 1, '', '', 'N'),
(211, 12, '<p><span style="font-size: small;">Sulphuric acid is added to a small amount of substance in a test tube. A &lsquo;pop&rsquo; sound was observed on bringing a burning matchstick to the mouth of the test tube. Some more amount of the same substance was then burnt to ashes. These ashes were then dissolved in water and tested with red litmus paper. The litmus paper turned blue.</span></p><br />\r\n<p><span style="font-size: small;">What can be concluded from the given experiment?</span></p>', '<p><span style="font-size: small;">The given substance is a non-metal and its oxide is acidic in nature</span></p>', '<p><span style="font-size: small;">The given substance is a metal and its oxide is basic in nature</span></p>', '<p><span style="font-size: small;">The given substance is a non-metal and its oxide is basic in nature</span></p>', '<p><span style="font-size: small;">The given substance is a metal and its oxide is acidic in nature</span></p>', 'ans2', 3, 10, 0, '', '', '', '', '', '', 1, '', '', 'N'),
(212, 12, '<p><span style="font-size: small;">A substance&nbsp;<strong>X&nbsp;</strong>is obtained from an exhaustible natural resource. It is a black and thick liquid with an unpleasant smell. It is a mixture of 175 &minus; 200 substances. Some of the products such as synthetic dyes, plastic paints, explosives, perfumes, etc are obtained using this resource.</span></p><br />\r\n<p><span style="font-size: small;">The substance&nbsp;<strong>X</strong>&nbsp;is</span></p>', '<p><span style="font-size: small;">Coke</span></p>', '<p><span style="font-size: small;">Coal tar</span></p>', '<p><span style="font-size: small;">Bitumen</span></p>', '<p><span style="font-size: small;">Lubricating oil</span></p>', 'ans2', 3, 10, 0, '', '', '', '', '', '', 1, '', '', 'N'),
(213, 12, '<p><span style="font-size: small;">Which of the following tables represents the effect of air and moisture on the given substances?</span></p>', '<p><img src="http://s14.postimg.org/4atr01e1t/18a.jpg" alt="" width="308" height="161" /></p>', '<p><img src="http://s29.postimg.org/kfuupe0lz/18b.jpg" alt="" width="308" height="162" /></p>', '<p><img src="http://s29.postimg.org/8s0suubh3/18c.jpg" alt="" width="308" height="162" /></p>', '<p><img src="http://s29.postimg.org/i2cwydm6v/18d.jpg" alt="" width="309" height="161" /></p>', 'ans3', 3, 10, 0, '', '', '', '', '', '', 1, '', '', 'N'),
(214, 12, '<p><span style="font-size: small;">The replacement of the <strong><em><span style="font-size: medium;">i</span></em></strong> active metal by a <span style="font-size: medium;"><em><strong>ii</strong></em></span> active metal takes place in a <em><strong><span style="font-size: medium;">iii</span></strong></em> reaction.</span></p><br />\r\n<p><span style="font-size: small;">The information in which alternative completes the given statement?</span></p>', '<p><img src="http://s8.postimg.org/eku6vd99x/19a.jpg" alt="" width="202" height="91" /></p>', '<p><img src="http://s10.postimg.org/8ohvitqwp/19b.jpg" alt="" width="204" height="92" /></p>', '<p><img src="http://s27.postimg.org/xs8baid2r/19c.jpg" alt="" width="201" height="92" /></p>', '<p><img src="http://s18.postimg.org/4636dj06x/19d.jpg" alt="" width="203" height="92" /></p>', 'ans2', 3, 10, 0, '', '', '', '', '', '', 1, '', '', 'N'),
(215, 12, '<p><span style="font-size: small;">Displacement reactions are characterized by&nbsp;the</span></p>', '<p><span style="font-size: small;">reaction of metals with acids to give hydrogen</span></p>', '<p><span style="font-size: small;">reaction in which non-metals form complexes with bases</span></p>', '<p><span style="font-size: small;">reaction of metals&nbsp;such as iron with air and moisture to form hydroxides and oxides</span></p>', '<p><span style="font-size: small;">reaction in which a metal replaces another metal from the compound of the latter</span></p>', 'ans4', 3, 10, 0, '', '', '', '', '', '', 1, '', '', 'N'),
(216, 13, '<p><span style="font-size: small;">Copper is <strong><em><span style="font-size: medium;">i</span></em></strong>&nbsp;<strong></strong>and copper sulphate is a <strong><em><span style="font-size: medium;">ii</span></em></strong>, while brass is a <em><strong><span style="font-size: medium;">iii</span></strong></em>.</span></p><br />\r\n<p><span style="font-size: small;">The information in which alternative completes the given statement?</span></p>', '<p><img src="http://s29.postimg.org/faeznby53/image.jpg" alt="" width="258" height="92" /></p>', '<p><img src="http://s3.postimg.org/dq7znmzvn/image.jpg" alt="" width="255" height="91" /></p>', '<p><img src="http://s27.postimg.org/pw24kdb8z/image.jpg" alt="" width="258" height="92" /></p>', '<p><img src="http://s11.postimg.org/4r8iwyzcz/image.jpg" alt="" width="258" height="92" /></p>', 'ans4', 3, 10, 0, '', '', '', '', '', '', 1, '', '', 'N'),
(217, 13, '<p><span style="font-size: small;">During a hot summer afternoon, a person coming from the outside feels cool after sitting under the fan.</span></p><br />\r\n<p><span style="font-size: small;">The person feels cool because of</span></p>', '<p><span style="font-size: small;">evaporative cooling</span></p>', '<p><span style="font-size: small;">increase in humidity</span></p>', '<p><span style="font-size: small;">change in air pressure</span></p>', '<p><span style="font-size: small;">decrease in temperature</span></p>', 'ans1', 3, 10, 0, '', '', '', '', '', '', 1, '', '', 'N'),
(218, 13, '<p><span style="font-size: small;">Galactose (C6H12O6), a form of sugar, is commonly found in dairy products, sugar beets, and gums. It is also synthesized by the body, where it forms a part of glycolipids and glycoproteins in several tissues. Galactose is less sweet than glucose, and is not highly soluble in water.</span></p><br />\r\n<p><span style="font-size: small;">The number of atoms present in 0.8 g of galactose is</span></p>', '<p><span style="font-size: small;">2.670 &times; 10<sup>21</sup></span></p>', '<p><span style="font-size: small;">3.204 &times; 10<sup>22</sup></span></p>', '<p><span style="font-size: small;">6.408 &times; 10<sup>22</sup></span></p>', '<p><span style="font-size: small;">6.023 &times; 10<sup>23</sup></span></p>', 'ans3', 3, 10, 0, '', '', '', '', '', '', 1, '', '', 'N'),
(219, 13, '<p><span style="font-size: small;">Rahul&rsquo;s teacher asked him to classify the following substances as mixtures and compounds:</span></p><br />\r\n<p><span style="font-size: small;"> Seawater, steel, common salt, table sugar, soil, and baking soda</span></p><br />\r\n<p><span style="font-size: small;">In which alternative are the given substances correctly listed?</span></p>', '<p><img src="http://s2.postimg.org/jy6ckcm7d/image.jpg" alt="" width="416" height="109" /></p>', '<p><img src="http://s9.postimg.org/vtei59e4v/image.jpg" alt="" width="416" height="108" /></p>', '<p><img src="http://s30.postimg.org/amlyosufl/image.jpg" alt="" width="416" height="109" /></p>', '<p><img src="http://s17.postimg.org/8yh66x5in/image.jpg" alt="" width="418" height="108" /></p>', 'ans2', 3, 10, 0, '', '', '', '', '', '', 1, '', '', 'N'),
(220, 13, '<p><span style="font-size: small;"><strong>I</strong>&nbsp;and&nbsp;<strong>II</strong>&nbsp;represent two changes.</span></p><br />\r\n<p><span style="font-size: small;"><strong>I.</strong>&nbsp;Rusting of an iron gate</span></p><br />\r\n<p><span style="font-size: small;"><strong>II.</strong>&nbsp;Boiling of water</span></p><br />\r\n<p><span style="font-size: small;">Which of the following statements is correct regarding the given changes?</span></p>', '<p><span style="font-size: small;">Both&nbsp;<strong>I</strong>&nbsp;and<strong>&nbsp;II&nbsp;</strong>are physical changes.</span></p>', '<p><span style="font-size: small;">Both&nbsp;<strong>I</strong>&nbsp;and&nbsp;<strong>II</strong>&nbsp;are chemical changes.</span></p>', '<p><span style="font-size: small;"><strong>I&nbsp;</strong>is a physical change while&nbsp;<strong>II</strong>&nbsp;is a chemical change.</span></p>', '<p><span style="font-size: small;"><strong>I</strong>&nbsp;is a chemical change while&nbsp;<strong>II</strong>&nbsp;is a physical change.</span></p>', 'ans4', 3, 10, 0, '', '', '', '', '', '', 1, '', '', 'N'),
(221, 13, '<p><span style="font-size: small;">The number of moles present in 66 g of carbon dioxide is</span></p>', '<p><span style="font-size: small;">0.5 mol</span></p>', '<p><span style="font-size: small;">1 mol</span></p>', '<p><span style="font-size: small;">1.5 mol</span></p>', '<p><span style="font-size: small;">2 mol</span></p>', 'ans3', 3, 10, 0, '', '', '', '', '', '', 1, '', '', 'N'),
(222, 13, '<p><span style="font-size: small;">Cryolite occurs in nature in the form of glassy and colourless monoclinic crystals. It is used in the electrolytic processing of the aluminum-rich oxide ore. The chemical formula of cryolite is Na<sub>3</sub>AlF<sub>6</sub>.</span></p><br />\r\n<p><span style="font-size: small;">Cryolite can be classified as</span></p>', '<p><span style="font-size: small;">an element</span></p>', '<p><span style="font-size: small;">a compound</span></p>', '<p><span style="font-size: small;">a mixture</span></p>', '<p><span style="font-size: small;">a solvent</span></p>', 'ans2', 3, 10, 0, '', '', '', '', '', '', 1, '', '', 'N'),
(223, 13, '<p><span style="font-size: small;">Reena took some ice cubes in a beaker. She observed that soon the container was covered with small water droplets on its outer surface.</span></p><br />\r\n<p><span style="font-size: small;">What can Reena account from her observation?</span></p>', '<p><span style="font-size: small;">Matter is made up of very small particles.</span></p>', '<p><span style="font-size: small;">Air contains large amount of water vapour.</span></p>', '<p><span style="font-size: small;">The surroundings around the beaker are very hot</span></p>', '<p><span style="font-size: small;">The water particles can pass through glass in liquid state.</span></p>', 'ans2', 3, 10, 0, '', '56c4f0b19b6da8660cfe55f1d300f2b4.jpg', '', '', '', '', 1, '', '', 'N'),
(224, 13, '<p><span style="font-size: small;">What is the mass of 0.4 mole of&nbsp;CO2?</span></p>', '<p><span style="font-size: small;">5.6 g</span></p>', '<p><span style="font-size: small;">8.8 g</span></p>', '<p><span style="font-size: small;">17.6 g</span></p>', '<p><span style="font-size: small;">26. 4 g</span></p>', 'ans3', 3, 10, 0, '', '', '', '', '', '', 1, '', '', 'N');
INSERT INTO `question_master` (`ques_id`, `test_id`, `ques`, `ans1`, `ans2`, `ans3`, `ans4`, `correct`, `subject_id`, `topic_id`, `sub_topic_id`, `level`, `ques_image`, `ans1_img`, `ans2_img`, `ans3_img`, `ans4_img`, `marks`, `isVisible`, `solution`, `isTextBox`) VALUES
(225, 13, '<p><span style="font-size: small;">Hydrochloric acid (HCl) is present in the stomach of human beings.</span></p><br />\r\n<p><span style="font-size: small;">Hydrochloric acid is</span></p>', '<p><span style="font-size: small;">a colloid</span></p>', '<p><span style="font-size: small;">a compound</span></p>', '<p><span style="font-size: small;">an element</span></p>', '<p><span style="font-size: small;">a mixture</span></p>', 'ans2', 3, 10, 0, '', 'b5557ded19aeb466d6a8f6d9f2e3b318.jpg', '', '', '', '', 1, '', '', 'N'),
(226, 13, '<p><span style="font-size: small;">Which process is involved in the drying of clothes?</span></p>', '<p><span style="font-size: small;">Evaporation</span></p>', '<p><span style="font-size: small;">Condensation</span></p>', '<p><span style="font-size: small;">Fusion</span></p>', '<p><span style="font-size: small;">Sublimation</span></p>', 'ans1', 3, 10, 0, '', '', '', '', '', '', 1, '', '', 'N'),
(227, 13, '<p><span style="font-size: small;">A compound has the chemical formula XCl<sub>4</sub>. The molecular mass of the compound is 154&nbsp;<em>u</em>.</span></p><br />\r\n<p><span style="font-size: small;">What is X?</span></p>', '<p><span style="font-size: small;">C</span></p>', '<p><span style="font-size: small;">N</span></p>', '<p><span style="font-size: small;">Pb</span></p>', '<p><span style="font-size: small;">Si</span></p>', 'ans1', 3, 10, 0, '', '', '', '', '', '', 1, '', '', 'N'),
(228, 13, '<p><span style="font-size: small;">Clothes take more time to dry on a rainy day. This shows that the rate of evaporation depends upon</span></p>', '<p><span style="font-size: small;">humidity</span></p>', '<p><span style="font-size: small;">surface area</span></p>', '<p><span style="font-size: small;">latent heat of vaporization</span></p>', '<p><span style="font-size: small;">latent heat of fusion</span></p>', 'ans1', 3, 10, 0, '', '', '', '', '', '', 1, '', '', 'N'),
(229, 13, '<p><span style="font-size: small;">The molecular formula of ferric sulphate is Fe<sub>2 &nbsp;</sub>(SO<sub>4</sub>)<sub>3</sub>. The atomic mass of iron (Fe), sulphur (S), and oxygen (O) is 56 u, 32 u, and 16 u respectively.</span></p><br />\r\n<p><span style="font-size: small;">What is the percentage of iron present in 1 mole of Fe<sub>2&nbsp;</sub>(SO<sub>4</sub>)<sub>3</sub>?</span></p>', '<p><span style="font-size: small;">24%</span></p>', '<p><span style="font-size: small;">28%</span></p>', '<p><span style="font-size: small;">44%</span></p>', '<p><span style="font-size: small;">48%</span></p>', 'ans2', 3, 10, 0, '', '', '', '', '', '', 1, '', '', 'N'),
(230, 13, '<p><span style="font-size: small;">Steam produces more severe burns than boiling water because the particles of vapour</span></p>', '<p><span style="font-size: small;">have better diffusing capability than water</span></p>', '<p><span style="font-size: small;">are more energetic than water</span></p>', '<p><span style="font-size: small;">have stronger forces of attraction than water</span></p>', '<p><span style="font-size: small;">are more corrosive than water</span></p>', 'ans2', 3, 10, 0, '', '', '', '', '', '', 1, '', '', 'N'),
