(232, 13, '<p><span style="font-size: small;">A piece of ice was taken in a closed conical flask and weighed. The flask was then kept at room temperature to melt the ice into water and was weighed again. It was found that there was no change in the weight of the flask, although a physical change had occurred.</span></p><br />\r\n<p><span style="font-size: small;">During the melting of ice to form water, the number of atoms</span></p>', '<p><span style="font-size: small;">decrease to half of the original volume</span></p>', '<p><span style="font-size: small;">neither decrease nor increase.</span></p>', '<p><span style="font-size: small;">increase to double of the original volume.</span></p>', '<p><span style="font-size: small;">decreased to one fourth of the original volume.</span></p>', 'ans2', 3, 10, 0, '', '', '', '', '', '', 1, '', '', 'N'),
