(246, 14, '<p><span style="font-size: small;">Sulphuric acid is added to a small amount of substance in a test tube. A &lsquo;pop&rsquo; sound was observed on bringing a burning matchstick to the mouth of the test tube. Some more amount of the same substance was then burnt to ashes. These ashes were then dissolved in water and tested with red litmus paper. The litmus paper turned blue.</span></p><br />\r\n<p><span style="font-size: small;">What can be concluded from the given experiment?</span></p>', '<p><span style="font-size: small;">The given substance is a non-metal and its oxide is acidic in nature</span></p>', '<p><span style="font-size: small;">The given substance is a metal and its oxide is basic in nature</span></p>', '<p><span style="font-size: small;">The given substance is a non-metal and its oxide is basic in nature</span></p>', '<p><span style="font-size: small;">The given substance is a metal and its oxide is acidic in nature</span></p>', 'ans2', 3, 10, 0, '', '', '', '', '', '', 1, '', '', 'N'),
