(249, 14, '<p><span style="font-size: small;">Which of the following metals can displace Fe from its salt solution?</span></p>', '<p><span style="font-size: small;">Pb</span></p>', '<p><span style="font-size: small;">Zn</span></p>', '<p><span style="font-size: small;">Ag</span></p>', '<p><span style="font-size: small;">Cu</span></p>', 'ans2', 3, 10, 0, '', '', '', '', '', '', 1, '', '', 'N'),
