(267, 15, '<p><span style="font-size: small;">Shashank takes 10 mL of liquids <strong>I</strong> and <strong>II</strong>. He observes that liquid <strong>I</strong> turns blue litmus red and liquid <strong>II</strong> turns red litmus blue. He also observes that when the two liquids are mixed, the resulting solution becomes warm. He then boils the solution to dryness. Consequently, a substance <strong>III</strong> is left in the beaker.</span></p><br />\r\n<p><span style="font-size: small;">Using his observations, Shashank can conclude that</span></p><br />\r\n<ol><br />\r\n<li><span style="font-size: small;">Liquid <strong>I</strong> is <strong><em><span style="font-size: medium;">i</span></em></strong> and <strong>B</strong> is <strong><em><span style="font-size: medium;">ii</span></em></strong> in nature. </span></li><br />\r\n<li><span style="font-size: small;">The substance <strong>III</strong> obtained in the beaker is a      salt.</span></li><br />\r\n<li><span style="font-size: small;">The salt produced in the reaction can be <em><strong><span style="font-size: medium;">iii</span></strong></em> in nature.</span></li><br />\r\n</ol><br />\r\n<p><span style="font-size: small;">The information in which alternative completes the given statements?</span></p>', '<p><img src="http://s30.postimg.org/rt3e8y2pd/11a.jpg" alt="" width="263" height="67" /></p>', '<p><img src="http://s3.postimg.org/c5hsv679f/11b.jpg" alt="" width="263" height="67" /></p>', '<p><img src="http://s7.postimg.org/f5kxtkjh7/11c.jpg" alt="" width="263" height="68" /></p>', '<p><img src="http://s22.postimg.org/q2i2oi2gh/11d.jpg" alt="" width="264" height="68" /></p>', 'ans1', 3, 10, 0, '', '', '', '', '', '', 1, '', '', 'N'),
