(271, 15, '<p><span style="font-size: small;">The wastes produced from factories contain many chemicals. These chemicals change the colour of blue litmus solution to red while the red litmus solution remains unaffected. When these chemicals are discharged in the water bodies, it harms the aquatic life. This is because these chemicals are <strong><em><span style="font-size: medium;">i</span></em></strong> in nature. Thus, <strong><em><span style="font-size: medium;">ii</span></em></strong> substances should be added to these chemicals before discharging them.</span></p><br />\r\n<p><span style="font-size: small;">The information in which alternative completes the given statements?</span></p>', '<p><img src="http://s9.postimg.org/lcus3bmln/15a.jpg" alt="" width="114" height="67" /></p>', '<p><img src="http://s3.postimg.org/v007zqk3j/15b.jpg" alt="" width="113" height="67" /></p>', '<p><img src="http://s12.postimg.org/za910igcp/15c.jpg" alt="" width="115" height="68" /></p>', '<p><img src="http://s17.postimg.org/l2h9wlwvv/15d.jpg" alt="" width="111" height="66" /></p>', 'ans2', 3, 10, 0, '', '', '', '', '', '', 1, '', '', 'N'),
