(306, 17, '<p><span style="font-size: small;">Malaria is a disease that is transmitted from one person to another through mosquitoes.</span></p><br />\r\n<p><span style="font-size: small;">Which of the following statements about preventive measures is&nbsp;<strong>not&nbsp;</strong>relevant for reducing malarial infection?</span></p>', '<p><span style="font-size: small;">Mosquito nets and repellents should be used to avoid contact with mosquitoes.</span></p>', '<p><span style="font-size: small;">Surroundings should be kept dry in order to prevent the breeding of mosquitoes.</span></p>', '<p><span style="font-size: small;">Food should be kept covered in order to prevent contact with mosquitoes.</span></p>', '<p><span style="font-size: small;">Insecticides should be sprayed periodically to kill mosquitoes.</span></p>', 'ans3', 4, 4, 0, '', '', '', '', '', '', 1, '', '', 'N'),
