(308, 17, '<p><span style="font-size: small;">Which of the following statements regarding preventive measures is&nbsp;<strong>not&nbsp;</strong>relevant for reducing malarial infection?</span></p>', '<p><span style="font-size: small;">Belongings of the patient suffering from malaria should be kept in isolation.</span></p>', '<p><span style="font-size: small;">Surroundings should be kept clean and dry to prevent the breeding of mosquitoes.</span></p>', '<p><span style="font-size: small;">Drinking water should be boiled before consumption.</span></p>', '<p><span style="font-size: small;">Food should be hygienically cooked.</span></p>', 'ans2', 4, 4, 0, '', '', '', '', '', '', 1, '', '', 'N'),
