(312, 17, '<p><span style="font-size: small;">Measles is a common human disease that occurs because of viral infection.</span></p><br />\r\n<p><span style="font-size: small;">Which of the following preventive measures does&nbsp;<strong>not</strong>&nbsp;help reduce the spread of measles?</span></p>', '<p><span style="font-size: small;">Vaccination at a suitable age</span></p>', '<p><span style="font-size: small;">Isolating the belongings of a patient</span></p>', '<p><span style="font-size: small;">Complete isolation of a patient from others</span></p>', '<p><span style="font-size: small;">Spraying of insecticides in the surroungings areas</span></p>', 'ans4', 4, 4, 0, '', '', '', '', '', '', 1, '', '', 'N'),
