(314, 17, '<p><span style="font-size: small;">Many birds migrate from one place to another during a particular time of the year.</span></p><br />\r\n<p><span style="font-size: small;">Birds fly to far away places during a particular time every year because of the</span></p>', '<p><span style="font-size: small;">decrease in the number of their predators</span></p>', '<p><span style="font-size: small;">increase in the number of their predators</span></p>', '<p><span style="font-size: small;">hospitable climatic conditions of their natural habitat</span></p>', '<p><span style="font-size: small;">inhospitable climatic conditions of their natural habitat</span></p>', 'ans4', 4, 4, 0, '', '', '', '', '', '', 1, '', '', 'N'),
