(340, 19, '<p><span style="font-size: small;">The basic functional unit of kidney regulates the concentration of water and soluble substances in the body. It functions by filtering blood under pressure. It then reabsorbs the necessary fluids and excretes the waste products.</span></p><br />\r\n<p><span style="font-size: small;">The above function is performed by</span></p>', '<p><span style="font-size: small;">renal artery</span></p>', '<p><span style="font-size: small;">nephron</span></p>', '<p><span style="font-size: small;">aorta</span></p>', '<p><span style="font-size: small;">renal vein</span></p>', 'ans2', 4, 4, 0, '', '2bed841911e0a9c98be14350958251ab.jpg', '', '', '', '', 1, '', '', 'N'),
(341, 19, '<p><span style="font-size: small;">A particular person has 22 pairs + XX as the chromosomal constitution.</span></p><br />\r\n<p><span style="font-size: small;">Which of the following hormones will not be released in the person?</span></p>', '<p><span style="font-size: small;">Oestrogen</span></p>', '<p><span style="font-size: small;">Thyroxine</span></p>', '<p><span style="font-size: small;">Testosterone</span></p>', '<p><span style="font-size: small;">Adrenaline</span></p>', 'ans3', 4, 4, 0, '', '', '', '', '', '', 1, '', '', 'N'),
(342, 19, '<p><span style="font-size: small;">Rachna visualised a permanent mount showing method of asexual reproduction in a unicellular organism and described the process in her notebook with the help of following write up &minus; In the given organism, the nucleus elongates first, followed by the elongation of entire cell. Subsequently, the nucleus divides into two parts followed by the division of cytoplasm. Finally, two distinct daughter cells are observed.</span></p><br />\r\n<p><span style="font-size: small;">The mount observed by Rachna was prepared using</span></p>', '<p><em><span style="font-size: small;">Plasmodium</span></em></p>', '<p><em><span style="font-size: small;">Amoeba</span></em></p>', '<p><em><span style="font-size: small;">Hydra</span></em></p>', '<p><span style="font-size: small;">Yeast</span></p>', 'ans2', 4, 4, 0, '', '', '', '', '', '', 1, '', '', 'N'),
(343, 19, '<p><span style="font-size: small;">The ureter performs the function of</span></p>', '<p><span style="font-size: small;">transporting urine out of the body</span></p>', '<p><span style="font-size: small;">transporting urine to the bladder</span></p>', '<p><span style="font-size: small;">producing urine</span></p>', '<p><span style="font-size: small;">storing urine</span></p>', 'ans2', 4, 4, 0, '', '', '', '', '', '', 1, '', '', 'N'),
(344, 19, '<p><span style="font-size: small;">The columns in the given table can be correctly matched as</span></p>', '<p><span style="font-size: small;">i &rarr; b, ii &rarr; a, iii &rarr; d, iv &rarr; c</span></p>', '<p><span style="font-size: small;">i &rarr; c, ii &rarr; a, iii &rarr; d, iv &rarr; b</span></p>', '<p><span style="font-size: small;">i &rarr; c, ii &rarr; d, iii &rarr; a, iv &rarr; b</span></p>', '<p><span style="font-size: small;">i &rarr; b, ii &rarr; d, iii &rarr; a, iv &rarr; c</span></p>', 'ans4', 4, 4, 0, '', '', '', '', '', '', 1, '', '', 'N'),
(345, 19, '<p><span style="font-size: small;">Which of the following statements is&nbsp;correct about the binary fission in&nbsp;<em>Amoeba</em>?</span></p>', '<p><span style="font-size: small;">Four daughter cells are formed from one parent cell.</span></p>', '<p><span style="font-size: small;">Cell division is followed by nuclear division.</span></p>', '<p><span style="font-size: small;">Cell does not elongate prior to the division.</span></p>', '<p><span style="font-size: small;">The cell divides unequally.</span></p>', 'ans3', 4, 4, 0, '', '', '', '', '', '', 1, '', '', 'N'),
(346, 19, '<p><span style="font-size: small;">The basic unit of the kidney is the nephron. It performs the function of</span></p>', '<p><span style="font-size: small;">filtering metabolic wastes from blood</span></p>', '<p><span style="font-size: small;">filtering carbon dioxide from blood</span></p>', '<p><span style="font-size: small;">excreting urine out of the body</span></p>', '<p><span style="font-size: small;">storing urine before excretion</span></p>', 'ans1', 4, 4, 0, '', '', '', '', '', '', 1, '', '', 'N'),
(347, 19, '<p><span style="font-size: small;">Which of the following figures&nbsp;does&nbsp;<strong>not</strong>&nbsp;represent a stage in the budding of yeast?</span></p>', '<p><img src="http://s21.postimg.org/av7yszn8z/12a.jpg" alt="" width="61" height="88" /></p>', '<p><img src="http://s4.postimg.org/rus92ic7d/12b.jpg" alt="" width="54" height="41" /></p>', '<p><img src="http://s16.postimg.org/yyg37fis1/12c.jpg" alt="" width="90" height="75" /></p>', '<p><img src="http://s15.postimg.org/j80xpow87/12d.jpg" alt="" width="34" height="25" /></p>', 'ans3', 4, 4, 0, '', '', '', '', '', '', 1, '', '', 'N'),
(348, 19, '<p><span style="font-size: small;">The lungs end in alveoli, which are sac-like structures. The alveoli surface allows the exchange of respiratory gases between the blood cells and air. This helps in the purification of blood. Kidneys also play a role in this process.</span></p><br />\r\n<p><span style="font-size: small;">The basic unit of kidney, where blood gets filtered, is called</span></p>', '<p><span style="font-size: small;">ureter</span></p>', '<p><span style="font-size: small;">neuron</span></p>', '<p><span style="font-size: small;">urethra</span></p>', '<p><span style="font-size: small;">nephron</span></p>', 'ans4', 4, 4, 0, '', '', '', '', '', '', 1, '', '', 'N'),
(349, 19, '<p><span style="font-size: small;">Adrenaline is&nbsp;a hormone secreted by the adrenal gland in humans under extreme conditions of stress. Which of the following statements&nbsp;about adrenaline is&nbsp;<strong>incorrect</strong>?</span></p>', '<p><span style="font-size: small;">It increases heart beat.</span></p>', '<p><span style="font-size: small;">It causes&nbsp;the contraction of diaphragm.</span></p>', '<p><span style="font-size: small;">It causes the contraction of muscles around arteries.</span></p>', '<p><span style="font-size: small;">It increases the flow of blood to the digestive system.</span></p>', 'ans4', 4, 4, 0, '', '', '', '', '', '', 1, '', '', 'N'),
(350, 19, '<p><span style="font-size: small;">During multiple fission, a single cell gives rise to many daughter cells on a single occasion.</span></p><br />\r\n<p><span style="font-size: small;">Which organism reproduces through multiple fission?</span></p>', '<p><em><span style="font-size: small;">Plasmodium</span></em></p>', '<p><em><span style="font-size: small;">Leishmania</span></em></p>', '<p><em><span style="font-size: small;">Planaria</span></em></p>', '<p><em><span style="font-size: small;">Hydra</span></em></p>', 'ans1', 4, 4, 0, '', '', '', '', '', '', 1, '', '', 'N'),
(351, 19, '<p><span style="font-size: small;"><strong>I</strong>,<strong>&nbsp;II</strong>,<strong>&nbsp;III</strong>,&nbsp;and<strong>&nbsp;IV</strong>&nbsp;represent the components of a dialysis machine.</span></p><br />\r\n<p><span style="font-size: small;">Which alternative represents the ascending order of concentration of urea in given components of dialysis machine?</span></p>', '<p><strong><span style="font-size: small;">I &lt; IV &lt; III &lt; II</span></strong></p>', '<p><strong><span style="font-size: small;">I &lt; III &lt; IV &lt; II</span></strong></p>', '<p><strong><span style="font-size: small;">IV &lt; II &lt; I &lt; III</span></strong></p>', '<p><strong><span style="font-size: small;">IV &lt; I &lt; II &lt; III</span></strong></p>', 'ans1', 4, 4, 0, '', 'bd0dba8b96a3f31a9f22e08fe3e0581e.jpg', '', '', '', '', 1, '', '', 'N'),
(352, 19, '<p><span style="font-size: small;">Binary fission is a method of reproduction that involves the</span></p>', '<p><span style="font-size: small;">splitting of a parent cell to form two cells</span></p>', '<p><span style="font-size: small;">splitting of a parent cell into many daughter cells</span></p>', '<p><span style="font-size: small;">formation of a new organism as a bud on the body of the parent</span></p>', '<p><span style="font-size: small;">formation of a new organism from the body fragments of the parent</span></p>', 'ans1', 4, 4, 0, '', '', '', '', '', '', 1, '', '', 'N'),
(353, 19, '<p><span style="font-size: small;">Budding is a type of asexual reproduction in which a new organism develops as an outgrowth on the body of the parent organism. It later detaches from the body of the parent to grow into an independent organism.</span></p><br />\r\n<p><span style="font-size: small;">The process of budding is observed in</span></p>', '<p><em><span style="font-size: small;">Plasmodium</span></em></p>', '<p><em><span style="font-size: small;">Leishmania</span></em></p>', '<p><em><span style="font-size: small;">Planaria</span></em></p>', '<p><em><span style="font-size: small;">Hydra</span></em></p>', 'ans4', 4, 4, 0, '', '', '', '', '', '', 1, '', '', 'N'),
(354, 19, '<p><span style="font-size: small;"><strong>I</strong>,<strong>&nbsp;II</strong>,<strong>&nbsp;III</strong>,&nbsp;and<strong>&nbsp;IV</strong>&nbsp;in the given figure illustrate the parts of a nephron.</span></p><br />\r\n<p><span style="font-size: small;">In which labelled part does re-absorption&nbsp;<strong>not</strong>&nbsp;take place?</span></p>', '<p><strong><span style="font-size: small;">I</span></strong></p>', '<p><span style="font-size: small;"><strong>II</strong></span></p>', '<p><span style="font-size: small;"><strong>III</strong></span></p>', '<p><strong><span style="font-size: small;">IV</span></strong></p>', 'ans4', 4, 4, 0, '', 'fce3b02c301b0a89731b51ff9cda67ea.jpg', '', '', '', '', 1, '', '', 'N'),
(355, 19, '<p><span style="font-size: small;">The given illustration represents the human endocrine system.</span></p><br />\r\n<p><span style="font-size: small;">In the given illustration, the pituitary gland is labelled as</span></p>', '<p><strong><span style="font-size: small;">I</span></strong></p>', '<p><span style="font-size: small;"><strong>II</strong></span></p>', '<p><span style="font-size: small;"><strong>III</strong></span></p>', '<p><span style="font-size: small;"><strong>IV</strong></span></p>', 'ans1', 4, 4, 0, '', '60f5476792e85250efbad49adff49b08.jpg', '', '', '', '', 1, '', '', 'N'),
(356, 19, '<p><span style="font-size: small;"><em>Amoeba</em>&nbsp;is a unicellular eukaryotic organism. It reproduces by</span></p>', '<p><span style="font-size: small;">fission</span></p>', '<p><span style="font-size: small;">budding</span></p>', '<p><span style="font-size: small;">regeneration</span></p>', '<p><span style="font-size: small;">fragmentation</span></p>', 'ans1', 4, 4, 0, '', '', '', '', '', '', 1, '', '', 'N'),
(357, 21, '<p>quesin 1</p>', '<p>qw</p>', '<p>sa</p>', '<p>as</p>', '<p>as</p>', '', 6, 11, 0, '', '', '', '', '', '', 21, '', '<p>as</p>', 'N');
